 sport itself and want to be able to provide these opportunities to young athletes. I began coaching my senior year of high school and have been able to see the girls grow both as players and young women. They began as most do, a little awkward and lacking confidence, but have grown into confident and competitive athletes. This growth is why I love to coach.',''),(441,2,31,'11','I was apart of a total of 5 clubs during my club career. Before my 5th season, I lacked confidence and wasn\'t sure if I even wanted to continue playing. I decided to tryout for Club One and it was the best decision of my volleyball career. The support and kindness both the coaches and players showed throughout the season was something I had never experienced before. Although we had multiple rough patches through the season, I still felt extremely connected to the players, coaches, and other staff all throughout the gym. The support that the club as a whole shows for each other is incredible, and all around a great support system for the players. A few teammates (Paige Padilla & Alexis Hill) from my season have joined as coaches for Club One and having nothing but great things to say about it. From my experience as a player, and the experiences that former teammates have shared with me, I would love to rejoin this community as part of the coaching staff.',''),(442,2,31,'13','Jenn Moore',''),(443,2,31,'17','jenmoore427@gmail.com',''),(444,2,31,'14','Samantha Day',''),(445,2,31,'18','samday0126@yahoo.com',''),(446,2,31,'15','Kristy Simmons',''),(447,2,31,'19','kristymsimmons@gmail.com',''),(448,5,32,'1.3','Celeste',''),(449,5,32,'1.6','Tauilo',''),(450,5,32,'2','7',''),(451,5,32,'26','53',''),(452,5,32,'5','Casteel',''),(453,5,32,'25.1','Indoor Club (Travel)',''),(454,5,32,'25.2','Indoor Club (Local)',''),(455,5,32,'25.8','Small Group Training',''),(456,5,32,'25.9','Camps & Clinics',''),(457,5,32,'4.2','Camp/Clinic',''),(458,5,32,'4.4','Local Club Team',''),(459,5,32,'27','Ace 15u',''),(460,5,