ammates as well.  Once I got to college and began coaching an 11\'s team, I knew this was what I wanted to do.  The look on a little girls face when she finally mastered a skill is something that will always bring me joy.  After getting the opportunity to coach high school and college age girls is when I realized that I could not only help mold young athletes into great volleyball players but guide them on there journeys this is what I am meant to being doing.',''),(708,2,47,'11','I year in and year out see the amazing following of young athletes and the great culture you have created and that is something that I would love to be apart of.  I think Club One can help me grow has a coach and strive to be the best I can be.',''),(709,2,47,'13','Kristi King',''),(710,2,47,'17','kking3@hotmail.com',''),(711,2,47,'14','Pat Mooney',''),(712,2,47,'18','pat.mooney@southmountaincc.edu',''),(713,2,47,'15','Melissa Hess',''),(714,2,47,'19','melissa.hess@southmountaincc.edu',''),(715,9,48,'1','Mira Banks',''),(716,9,48,'2','2026',''),(717,9,48,'14','Kyrene Middle School',''),(718,9,48,'3','(480) 286-7731',''),(719,9,48,'4','Tempe (Court One Athletics)',''),(720,9,48,'5','14U Club',''),(721,9,48,'6','2x/week',''),(722,9,48,'8','1',''),(723,9,48,'15','N/A',''),(724,9,48,'9.3','Jennifer',''),(725,9,48,'9.6','Banks',''),(726,9,48,'10','(480) 286-7731',''),(727,9,48,'11','banksj125@gmail.com',''),(728,9,48,'gravityformsmailchimp_is_fulfilled','1',NULL),(729,9,48,'processed_feeds','a:1:{s:21:\"gravityformsmailchimp\";a:1:{i:0;s:1:\"5\";}}',NULL),(730,9,49,'1','Audra Gorder',''),(731,9,49,'2','2025',''),(732,9,49,'14','Lincoln Prep',''),(733,9,49,'3','(480) 528-9044',''),(734,9,49,'4','East (Casteel HS-Queen Creek)',''),(735,9,49,'5','Hybrid',''),(736,9,49,'6','(1x/week - Hybrid package only)',''),(737,9,49,'8','3+',''),(738,9,49,'15','N/A',''),(739,9,49,'9.3','Derek',''),(740,9,49,'9.6','Gorder',''),(741,9,49,'10','(480) 296-6440',''),(742,9,49,'11','doubled92@cox.net',''),(743,9,49,'