ced the compatibility between the <code>[tribe_events]</code> shortcode, particularly the Month View, and Elementor to ensure the shortcode correctly renders in the Editor [ECP-374, ECP-376]</li>\r\n<li>Language - 0 new strings added, 7 updated, 0 fuzzied, and 0 obsoleted</li>\r\n</ul>\";}s:14:\"upgrade_notice\";s:0:\"\";s:13:\"custom_update\";O:8:\"stdClass\":1:{s:5:\"icons\";O:8:\"stdClass\":1:{s:3:\"svg\";s:84:\"https://theeventscalendar.com/content/themes/tribe-ecp/img/svg/product-icons/ECP.svg\";}}s:11:\"api_expired\";b:0;s:11:\"api_upgrade\";b:0;}}','no'),(1186,'blog_public','1','yes'),(1187,'upload_path','','yes'),(1188,'upload_url_path','','yes'),(1189,'wpmdb_error_log','********************************************\n******  Log date: 2020/04/06 23:57:10 ******\n********************************************\n\nIntent: pull\nAction: wpmdb_verify_connection_to_remote_site\nWPMDB Error: <b>Version Mismatch</b> &mdash; We\'ve detected you have version 1.9.10 of WP Migrate DB Pro at clubone.monodev.co but are using 1.9.9 here. Please go to the <a href=\"%%plugins_url%%\">Plugins page</a> on both installs and check for updates.\n\nArray\n(\n    [action] => wpmdb_verify_connection_to_remote_site\n    [intent] => pull\n    [referer] => club-one.test\n    [version] => 1.9.9\n    [sig] => HljtylKB0X6qPtdnAnXS3LMMSyk=\n)\n\n\n********************************************\n******  Log date: 2020/04/08 15:56:56 ******\n********************************************\n\nIntent: pull\nAction: wpmdb_verify_connection_to_remote_site\nWPMDB Error: We could not find: https://club-one.test. Are you sure this is the correct URL?\n\nWP_Error Object\n(\n    [errors] => Array\n        (\n            [http_request_failed] => Array\n                (\n                    [0] => cURL error 6: Could not resolve host: club-one.test\n                )\n\n        )\n\n    [error_data] => Array\n        (\n        )\n\n)\n\n\n********************************************\n******  Log date: 2020/0