ader','Learn The Game'),(4845,240,'_training_info_0_subheader','field_5edf301259721'),(4846,240,'training_info_0_content','Serve, pass, set, hitlearn how to play volleyball with One U, the early skills development branch of Club One and One Beach! We offer One U camps and clinics throughout the year for Beginner athletes ages 12 and under. One U coaches teach proper technique, introduce fun game play, and help young volleyball players fall in love with the sport.'),(4847,240,'_training_info_0_content','field_5edf301759722'),(4848,240,'training_info_0_link','/events/category/training/'),(4849,240,'_training_info_0_link','field_5edf302759723'),(4850,240,'training_info_1_image','298'),(4851,240,'_training_info_1_image','field_5edf49958f70e'),(4852,240,'training_info_1_header','Small Group Training'),(4853,240,'_training_info_1_header','field_5edf300e59720'),(4854,240,'training_info_1_subheader','Practice To Perform'),(4855,240,'_training_info_1_subheader','field_5edf301259721'),(4856,240,'training_info_1_content','Work on specific volleyball skills and mindsets with other Experienced and Select athletes at a Small Group Training (SGT) session. Whether the focus is serve-receive, attacking technique, or advanced setter training, we limit group size and tailor each SGT session to specific grade levels so that similarly skilled athletes can practice in a focused, high-rep environment.'),(4857,240,'_training_info_1_content','field_5edf301759722'),(4858,240,'training_info_1_link','/events/category/training/'),(4859,240,'_training_info_1_link','field_5edf302759723'),(4860,240,'training_info_btm_0_image','886'),(4861,240,'_training_info_btm_0_image','field_5edf302e59725'),(4862,240,'training_info_btm_0_header','Clinics'),(4863,240,'_training_info_btm_0_header','field_5edf302e59726'),(4864,240,'training_info_btm_0_subheader','Maximize Your Reps'),(4865,240,'_training_info_btm_0_subheader','field_5edf302e59727'),(4866,240,'training_info_btm_0_content','Learn from a variety of coaches, make new friends, and play a lot of volleyball! In the gym or on the sand, we structure our clinics to include age-appropriate skills instruction, engaging game play, and lots of reps. Check back year-round for Pre-Tryout clinics, Beach clinics, and more.'),(4867,240,'_training_info_btm_0_content','field_5edf302e59728'),(4868,240,'training_info_btm_0_link','/events/category/training/'),(4869,240,'_training_info_btm_0_link','field_5edf302e59729'),(4870,240,'training_info_btm_1_image','884'),(4871,240,'_training_info_btm_1_image','field_5edf302e59725'),(4872,240,'training_info_btm_1_header','Private Lessons'),(4873,240,'_training_info_btm_1_header','field_5edf302e59726'),(4874,240,'training_info_btm_1_subheader','Sharpen Your Skills'),(4875,240,'_training_info_btm_1_subheader','field_5edf302e59727'),(4876,240,'training_info_btm_1_content','Are you an Experienced player struggling to make skills corrections in the middle of a season? Are you a Select athlete looking to fine-tune your technique before tryouts? Are you a Beginner wanting to practice basic skills before participating in a volleyball camp or clinic? Get focused reps and personalized instruction in a private lesson with one of our specialized club coaches.'),(4877,240,'_training_info_btm_1_content','field_5edf302e59728'),(4878,240,'training_info_btm_1_link','/forms/private-lesson-request/'),(4879,240,'_training_info_btm_1_link','field_5edf302e59729'),(4889,411,'_menu_item_type','post_type'),(4890,411,'_menu_item_menu_item_parent','318'),(4891,411,'_menu_item_object_id','303'),(4892,411,'_menu_item_object','page'),(4893,411,'_menu_item_target',''),(4894,411,'_menu_item_classes','a:1:{i:0;s:0:\"\";}'),(4895,411,'_menu_item_xfn',''),(4896,411,'_menu_item_url',''),(4898,412,'_menu_item_type','post_type'),(4899,412,'_menu_item_menu_item_parent','318'),(4900,412,'_menu_item_object_id','305'),(4901,412,'_menu_item_object','page'),(4902,412,'_menu_item_target',''),(4903,412,'_menu_item_classes','a:1:{i:0;s: