:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(5153,326,'_thumbnail_id','732'),(5154,326,'donate_link','https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=QT8KWQCYFZKAA&source=url'),(5155,326,'_donate_link','field_5ee92c9b26f72'),(5156,326,'need_your_support_content','Your support empowers us to make a difference in our community. Your tax-deductible donations help fund need-based scholarships for our athletes, provide professional development opportunities for our coaches, offset the cost of high-performance equipment and gear, and build our audacious vision for the future.'),(5157,326,'_need_your_support_content','field_5ee92cbf26f73'),(5158,326,'founder_image','482'),(5159,326,'_founder_image','field_5ee92cd126f74'),(5160,326,'note_from_founder','My wife and I understand the value that competitive sport offers, from both our own college athletic experiences and those of our daughters. We have seen how youth sports can be a powerful vehicle for developing strong character, in addition to fostering fitness and providing an outlet for that inner competitive drive. With this in mind, we spent the summer of 2010 developing the foundation for the purposeful and unique club culture that is now embodied in Club One.\r\n\r\nWe wanted to build a sports organization that would respect people as well as promote competition. We wanted to make sure each individual athlete would know their value, while also teaching them that the individual is elevated most effectively in the context of a team. We wanted to make a difference: a difference in the way players and parents are valued, a difference in the way coaches are developed, a difference in the way competition is advanced, and a difference in how success is achieved.\r\n\r\nNow, so many years into our journey, we see many of the outcomes we had hoped for taking shape in our athletes and in our like-minded coaches as they commit to the challenge of continual growth and embrace our motto: We are one.\r\n\r\nWe dont venture to think we have arrived at our goals, but we do believe we are on our way. We realize that our perspective may not align with everyones experiences, but we do believe that our culture brings out the best in people and prepares our athletes handsomely for the futures ahead of them.\r\n\r\nWe hope that you will choose to join us on our continuing journey.\r\nSincerely,\r\n<h4>David &amp; Larisa Ronda</h4>\r\n<strong>Club Directors</strong>'),(5161,326,'_note_from_founder','field_5ee92cde26f75'),(5162,326,'donations_info','2'),(5163,326,'_donations_info','field_5ee92d0726f76'),(5164,326,'have_questions_description','Want to learn more before donating to our organization? Wondering if there are other creative ways you can make an impact? We are happy to dialogue more.'),(5165,326,'_have_questions_description','field_5ee92d8126f7c'),(5166,326,'have_questions_link','/have-questions/'),(5167,326,'_have_questions_link','field_5ee92dca26f7e'),(5168,326,'make_a_donation_description','Your support empowers us to make a difference in our community. Be a part of building our audacious vision for the future.'),(5169,326,'_make_a_donation_description','field_5ee92d9126f7d'),(5170,326,'make_a_donation_link','https://www.paypal.com/cgi-bin/webscr?cmd=_s-xclick&hosted_button_id=QT8KWQCYFZKAA&source=url'),(5171,326,'_make_a_donation_link','field_5ee92dd326f7f'),(5172,326,'_yoast_wpseo_content_score','30'),(5173,326,'donations_info_0_image','897'),(5174,326,'_donations_info_0_image','field_5ee938847cc94'),(5175,326,'donations_info_0_header','Start Small'),(5176,326,'_donations_info_0_header','field_5ee92d1926f77'),(5177,326,'donations_info_0_subheader','Donations under $1,000'),(5178,326,'_donations_info_0_subheader','field_5ee92d2326f78'),(5179,326,'donations_info_0_content','<strong>$45</s