487'),(5273,12,'_experience_image','field_5ee9673300fc5'),(5274,12,'experience_levels_0_title','Select'),(5275,12,'_experience_levels_0_title','field_5ee9675000fc7'),(5276,12,'experience_levels_0_ages','Age 14-18'),(5277,12,'_experience_levels_0_ages','field_5ee9675500fc8'),(5278,12,'experience_levels_0_description','INDOOR: One or two seasons of national club team and/or high school Varsity volleyball. Able to jump float serve and consistently use all three contacts. BEACH: Three or more years of beach club, participation in 15+ tournaments. Able to serve strategically, read serve off the hand when passing, adjust sets to partner and environment, and attack from middle/back-row/pin.'),(5279,12,'_experience_levels_0_description','field_5ee9675a00fc9'),(5280,12,'experience_levels_1_title','Experienced'),(5281,12,'_experience_levels_1_title','field_5ee9675000fc7'),(5282,12,'experience_levels_1_ages','Age 12-18'),(5283,12,'_experience_levels_1_ages','field_5ee9675500fc8'),(5284,12,'experience_levels_1_description','INDOOR: One or two seasons of Rec program, school team, and/or local club team. Able to serve overhand and familiar with using all three contacts. BEACH: At least one year of beach club or two years of indoor club, participation in five or more beach tournaments. Able to jump float, pass short and deep serves, square to hitter when setting, and open to the court when hitting.'),(5285,12,'_experience_levels_1_description','field_5ee9675a00fc9'),(5286,12,'experience_levels_2_title','Beginner'),(5287,12,'_experience_levels_2_title','field_5ee9675000fc7'),(5288,12,'experience_levels_2_ages','Age 8-14'),(5289,12,'_experience_levels_2_ages','field_5ee9675500fc8'),(5290,12,'experience_levels_2_description','INDOOR: One to two seasons of YMCA volleyball, or has never played before. Learning how to overhand serve and use all three contacts. BEACH: No experience required, but we expect the same hard work and dedication as we do from our advance athletes. Learning how 