5854,17,'_volleyball_options_0_link','field_5ef2a41c621b9'),(5855,17,'volleyball_options_0_bg_image','641'),(5856,17,'_volleyball_options_0_bg_image','field_5ef2a41c62205'),(5857,17,'volleyball_options_1_title','Club'),(5858,17,'_volleyball_options_1_title','field_5ef2a41c62115'),(5859,17,'volleyball_options_1_description','We field club teams for volleyball players ages eight to eighteen, for a season that lasts six to eight months. Our National level teams travel out-of-state for multi-day tournaments, qualify for National Championships, and prepare athletes to succeed in college volleyball programs. Our Region level teams compete locally and nurture developing players. All club teams practice in an unparalleled training environment with superior coaches.'),(5860,17,'_volleyball_options_1_description','field_5ef2a41c6216c'),(5861,17,'volleyball_options_1_link','/events/category/club/'),(5862,17,'_volleyball_options_1_link','field_5ef2a41c621b9'),(5863,17,'volleyball_options_1_bg_image','644'),(5864,17,'_volleyball_options_1_bg_image','field_5ef2a41c62205'),(5865,17,'volleyball_options_2_title','Events'),(5866,17,'_volleyball_options_2_title','field_5ef2a41c62115'),(5867,17,'volleyball_options_2_description','We host fun, competitive events for volleyball athletes ages eleven to eighteen, with separate divisions for developing players and competitive athletes. Athletes form their own teams and compete in an organized tournament format for the chance to win prizes. Club One also offers camps and clinics throughout the year for any volleyball players seeking specialized instruction, guided training repetitions, and effective skill development.'),(5868,17,'_volleyball_options_2_description','field_5ef2a41c6216c'),(5869,17,'volleyball_options_2_link','/events/category/recreation/'),(5870,17,'_volleyball_options_2_link','field_5ef2a41c621b9'),(5871,17,'volleyball_options_2_bg_image','640'),(5872,17,'_volleyball_options_2_bg_image','field_5ef2a41c62205'),(5873,17,'volleyball_options','3'),(5874,17,'_volleyball_options','field_5ef2a41c4c644'),(5875,17,'banner_image','645'),(5876,17,'_banner_image','field_5ef2a4514cb95'),(5877,17,'_yoast_wpseo_content_score','60'),(5878,640,'_wp_attached_file','2020/06/indoor_events.jpg'),(5879,640,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:473;s:6:\"height\";i:639;s:4:\"file\";s:25:\"2020/06/indoor_events.jpg\";s:5:\"sizes\";a:2:{s:6:\"medium\";a:4:{s:4:\"file\";s:25:\"indoor_events-222x300.jpg\";s:5:\"width\";i:222;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:9:\"thumbnail\";a:4:{s:4:\"file\";s:25:\"indoor_events-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(5880,641,'_wp_attached_file','2020/06/recreation.jpg'),(5881,641,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:473;s:6:\"height\";i:639;s:4:\"file\";s:22:\"2020/06/recreation.jpg\";s:5:\"sizes\";a:2:{s:6:\"medium\";a:4:{s:4:\"file\";s:22:\"recreation-222x300.jpg\";s:5:\"width\";i:222;s:6:\"height\";i:300;s:9:\"mime-type\";s:10:\"image/jpeg\";}s:9:\"thumbnail\";a:4:{s:4:\"file\";s:22:\"recreation-150x150.jpg\";s:5:\"width\";i:150;s:6:\"height\";i:150;s:9:\"mime-type\";s:10:\"image/jpeg\";}}s:10:\"image_meta\";a:12:{s:8:\"aperture\";s:1:\"0\";s:6:\"credit\";s:0:\"\";s:6:\"camera\";s:0:\"\";s:7:\"caption\";s:0:\"\";s:17:\"created_timestamp\";s:1:\"0\";s:9:\"copyright\";s:0:\"\";s:12:\"focal_length\";s:1:\"0\";s:3:\"iso\";s:1:\"0\";s:13:\"shutter_speed\";s:1:\"0\";s:5:\"title\";s:0:\"\";s:11:\"orientation\";s:1:\"0\";s:8:\"keywords\";a:0:{}}}'),(5884,644,'_wp_attached_file','2020/06/club.jpg'),(5885,644,'_wp_attachment_meta