ons_0_bg_image','641'),(8624,901,'_volleyball_options_0_bg_image','field_5ef2a41c62205'),(8625,901,'volleyball_options_1_title','Club'),(8626,901,'_volleyball_options_1_title','field_5ef2a41c62115'),(8627,901,'volleyball_options_1_description','We field club teams for volleyball players ages eight to eighteen, for a season that lasts six to eight months. Our National level teams travel out-of-state for multi-day tournaments, qualify for National Championships, and prepare athletes to succeed in college volleyball programs. Our Region level teams compete locally and nurture developing players. All club teams practice in an unparalleled training environment with superior coaches.'),(8628,901,'_volleyball_options_1_description','field_5ef2a41c6216c'),(8629,901,'volleyball_options_1_link','#'),(8630,901,'_volleyball_options_1_link','field_5ef2a41c621b9'),(8631,901,'volleyball_options_1_bg_image','644'),(8632,901,'_volleyball_options_1_bg_image','field_5ef2a41c62205'),(8633,901,'volleyball_options_2_title','Events'),(8634,901,'_volleyball_options_2_title','field_5ef2a41c62115'),(8635,901,'volleyball_options_2_description','We host fun, competitive events for volleyball athletes ages eleven to eighteen, with separate divisions for developing players and competitive athletes. Athletes form their own teams and compete in an organized tournament format for the chance to win prizes. Club One also offers camps and clinics throughout the year for any volleyball players seeking specialized instruction, guided training repetitions, and effective skill development.'),(8636,901,'_volleyball_options_2_description','field_5ef2a41c6216c'),(8637,901,'volleyball_options_2_link','/events'),(8638,901,'_volleyball_options_2_link','field_5ef2a41c621b9'),(8639,901,'volleyball_options_2_bg_image','640'),(8640,901,'_volleyball_options_2_bg_image','field_5ef2a41c62205'),(8641,901,'volleyball_options','3'),(8642,901,'_volleyball_options','field_5ef2a41c4c644'),(8643,901,'banner_image','645'),(8644,901,'_banner_image','field_5ef2a4514cb95'),(8645,902,'_edit_lock','1596311479:2'),(8646,902,'_edit_last','2'),(8647,903,'club_one_coaches_content','Weve spent years building a diverse and dedicated coaching staff, full of decorated champions, current and former college athletes, and students of the game. Were always looking to add coaches with volleyball knowledge and expertise who are willing to embrace the culture behind our motto: We are one.'),(8648,903,'_club_one_coaches_content','field_5ef0fc5f05241'),(8649,903,'apply_to_be_a_coach_content','Once you complete and submit the form, our Club Directors will be in touch!'),(8650,903,'_apply_to_be_a_coach_content','field_5ef0fca205242'),(8651,903,'light_header',''),(8652,903,'_light_header','field_5edf43e023308'),(8653,904,'light_header','a:1:{i:0;s:3:\"yes\";}'),(8654,904,'_light_header','field_5edf43e023308'),(8655,904,'club_one_teams_description','From seven indoor club teams in our first season to 24+ teams ten years later, our Club One program continues to grow and thrive. Explore our current or proposed indoor teams for each age group, get to know our dedicated coaches, and find the latest news for our ever-growing alumni base. \r\n\r\nBefore each new club season, we update this page with proposed teams and coaches for the upcoming year. After the tryout period concludes, we add current rosters and schedules for each team, ages 12U to 18U.'),(8656,904,'_club_one_teams_description','field_5eebb3bd55720'),(8659,906,'_menu_item_type','post_type'),(8660,906,'_menu_item_menu_item_parent','318'),(8661,906,'_menu_item_object_id','306'),(8662,906,'_menu_item_object','page'),(8663,906,'_menu_item_target',''),(8664,906,'_menu_item_classes','a:1:{i:0;s:0:\"\";}'),(8665,906,'_menu_item_xfn',''),(8666,906,'_menu_item_url',''),(8668,907,'_wp_attached_file','2019/11/Post111419.jpg'),(8669,907,'_wp_attachment_metadata','a:5:{s:5:\"width\";i:1500;s:6:\"height\";i:1000;s:4:\"file\";s:22:\"2019/11/Post111419.jpg\";s:5:\"sizes