10816,12,'in-door_club_button_text','Learn More'),(10817,12,'_in-door_club_button_text','field_5f1bc77778e2a'),(10818,12,'beach_club_button_text','Learn More'),(10819,12,'_beach_club_button_text','field_5f1bc78678e2b'),(10820,12,'which_level_button_text','Contact Us'),(10821,12,'_which_level_button_text','field_5f1bc7cc78e2c'),(10822,1141,'training_options_content','Beyond team practices and competition, we offer a variety of ways for you to grow your volleyball skills and learn from our experienced coaches. Volleyball training opportunities are available in-season and out-of-season for Beginner, Experienced, and Select athletes.'),(10823,1141,'_training_options_content','field_5edf2f995971d'),(10824,1141,'training_info_0_image','885'),(10825,1141,'_training_info_0_image','field_5edf49958f70e'),(10826,1141,'training_info_0_header','One U'),(10827,1141,'_training_info_0_header','field_5edf300e59720'),(10828,1141,'training_info_0_subheader','Learn The Game'),(10829,1141,'_training_info_0_subheader','field_5edf301259721'),(10830,1141,'training_info_0_content','Serve, pass, set, hitlearn how to play volleyball with One U, the early skills development branch of Club One and One Beach! We offer One U camps and clinics throughout the year for Beginner athletes ages 12 and under. One U coaches teach proper technique, introduce fun game play, and help young volleyball players fall in love with the sport.'),(10831,1141,'_training_info_0_content','field_5edf301759722'),(10832,1141,'training_info_0_link','/events/category/training/'),(10833,1141,'_training_info_0_link','field_5edf302759723'),(10834,1141,'training_info_0_button_text','t'),(10835,1141,'_training_info_0_button_text','field_5f1bc8aa92082'),(10836,1141,'training_info_1_image','298'),(10837,1141,'_training_info_1_image','field_5edf49958f70e'),(10838,1141,'training_info_1_header','Small Group Training'),(10839,1141,'_training_info_1_header','field_5edf300e59720'),(10840,1141,'training_info_1_subheader','Practice To Perform'),(10841,1141,'_training_info_1_subheader','field_5edf301259721'),(10842,1141,'training_info_1_content','Work on specific volleyball skills and mindsets with other Experienced and Select athletes at a Small Group Training (SGT) session. Whether the focus is serve-receive, attacking technique, or advanced setter training, we limit group size and tailor each SGT session to specific grade levels so that similarly skilled athletes can practice in a focused, high-rep environment.'),(10843,1141,'_training_info_1_content','field_5edf301759722'),(10844,1141,'training_info_1_link','/events/category/training/'),(10845,1141,'_training_info_1_link','field_5edf302759723'),(10846,1141,'training_info_1_button_text',''),(10847,1141,'_training_info_1_button_text','field_5f1bc8aa92082'),(10848,1141,'training_info','2'),(10849,1141,'_training_info','field_5edf2ff85971e'),(10850,1141,'banner_image','407'),(10851,1141,'_banner_image','field_5edf30365972a'),(10852,1141,'training_info_btm_0_image','886'),(10853,1141,'_training_info_btm_0_image','field_5edf302e59725'),(10854,1141,'training_info_btm_0_header','Clinics'),(10855,1141,'_training_info_btm_0_header','field_5edf302e59726'),(10856,1141,'training_info_btm_0_subheader','Maximize Your Reps'),(10857,1141,'_training_info_btm_0_subheader','field_5edf302e59727'),(10858,1141,'training_info_btm_0_content','Learn from a variety of coaches, make new friends, and play a lot of volleyball! In the gym or on the sand, we structure our clinics to include age-appropriate skills instruction, engaging game play, and lots of reps. Check back year-round for Pre-Tryout clinics, Beach clinics, and more.'),(10859,1141,'_training_info_btm_0_content','field_5edf302e59728'),(10860,1141,'training_info_btm_0_link','/events/category/training/'),(10861,1141,'_training_info_btm_0_link','field_5edf302e59729'),(10862,1141,'training_info_btm_0_button_text','t'),(10863,1141,'_training_info_btm_0_button_text','field_5f1bc8b692083'),(10864,1141,'training_info_btm_1_image','884'),(10865,1141,'_training_info_btm_1_image','field_5edf302e59725'),(10866,1141,'training_info_btm_1_header','Private Lessons'),(10867,1141,'_training_info_btm_1_header','field_5edf302e59726'),(10868,1141,'training_info_btm_1_subheader','Sharpen Your Skills'),(10869,1141,'_training_info_btm_1_subheader','field_5edf302e59727'),(10870,1141,'training_info_btm_1_content','Are you an Experienced player struggling to make skills corrections in the middle of a season? Are you a Select athlete looking to fine-tune your technique before tryouts? Are you a Beginner wanting to practice basic skills before participating in a volleyball camp or clinic? Get focused reps and personalized instruction in a private lesson with one of our specialized club coaches.'),(10871,1141,'_training_info_btm_1_content','field_5edf302e59728'),(10872,1141,'training_info_btm_1_link','/forms/private-lesson-request/'),(10873,1141,'_training_info_btm_1_link','field_5edf302e59729'),(10874,1141,'training_info_btm_1_button_text',''),(10875,1141,'_training_info_btm_1_button_text','field_5f1bc8b692083'),(10876,1141,'training_info_btm','2'),(10877,1141,'_training_info_btm','field_5edf302e59724'),(10878,1141,'light_header','a:1:{i:0;s:3:\"yes\";}'),(10879,1141,'_light_header','field_5edf43e023308'),(10880,240,'training_info_0_button_text',''),(10881,240,'_training_info_0_button_text','field_5f1bc8aa92082'),(10882,240,'training_info_1_button_text',''),(10883,240,'_training_info_1_button_text','field_5f1bc8aa92082'),(10884,240,'training_info_btm_0_button_text',''),(10885,240,'_training_info_btm_0_button_text','field_5f1bc8b692083'),(10886,240,'training_info_btm_1_button_text',''),(10887,240,'_training_info_btm_1_button_text','field_5f1bc8b692083'),(10888,7,'intro_button_text','Learn More'),(10889,7,'_intro_button_text','field_5f1bccc019365'),(10890,326,'donate_button_text','Donate Now'),(10891,326,'_donate_button_text','field_5f1bcdd36a5f4'),(10892,326,'have_questions_button_text','Reach Out'),(1