 most recently has spearheaded our Leadership &amp; Success Coaching (LSC) program for national-level teams.\r\n\r\nIn 10 years at the helm of 18Platinum, Kelseys teams have earned two GJNC Open bids, one GJNC USA bid, and two GJNC National bids (both with gold bracket finishes). Every one of her 18Platinum athletes who had the desire to play collegiately has gone on to realize that dream. Kelsey now has former players competing at every level, from junior college to NCAA DI, as well as professionally. In addition, she has had the privilege of coaching two athletes who went on to become All-Americans: McKenna Woodford and Taylor Garner.\r\n\r\nBefore her coaching career, Kelsey enjoyed a successful playing career both indoor and on the beach. During her junior year of high school, she and her Colorado Juniors club team took first place at the GJNC. Kelsey went on to be a four-year starting middle blocker and captain at the University of Buffalo, where she earned multiple Player of the Week honors and was Top Five in the nation for blocks her freshman season before sustaining a knee injury. After her college career, Kelsey competed on the beach circuit, where she and her partner won the Barefoot Wine Qualifier.\r\n\r\nKelsey coaches because this game (and more specifically, the people in it) changed her life as a player. She believes that the successes and failures experienced in a team environment prepare us for life, while also giving us the thrill of competition in the midst of it. Kelsey believes in the mission, vision, and people in the Club One AZ family of coaches with her whole heart and soul. She believes that we can impact and build strong, confident young women while also competing at the highest level in the nation.\r\n\r\nOutside of volleyball, Kelsey enjoys watching live sports or live music with her husband and fellow coach, David Girts. She also loves playing with their two daughters (Finley &amp; Adalynn) and traveling, exploring, or relaxing with their family and friends who have become family.','Kelsey Girts','','publish','closed','closed','','kelsey-girts','','','2020-08-01 14:37:35','2020-08-01 21:37:35','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=527',49,'coaches','',0),(529,1,'2020-06-17 18:56:24','2020-06-17 18:56:24','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:7:\"coaches\";}}}s:8:\"position\";s:15:\"acf_after_title\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";s:0:\"\";s:11:\"description\";s:0:\"\";}','Coaches Fields','coaches-fields','publish','closed','closed','','group_5eea66f6284b9','','','2020-06-17 18:56:24','2020-06-17 18:56:24','',0,'http://clubonevb.wpengine.com/?post_type=acf-field-group&#038;p=529',0,'acf-field-group','',0),(530,1,'2020-06-17 18:56:24','2020-06-17 18:56:24','a:10:{s:4:\"type\";s:4:\"text\";s:12:\"instructions\";s:22:\"if needed add position\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:11:\"placeholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";}','Position','position','publish','closed','closed','','field_5eea6730765bb','','','2020-06-17 18:56:24','2020-06-17 18:56:24','',529,'http://clubonevb.wpengine.com/?post_type=acf-field&p=530',0,'acf-field','',0),(531,1,'2020-06-17 21:57:45','2020-06-17 21:57:45','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:5:\"teams\";}}}s:8:\"position\";s:15:\"acf_after_title\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instruction_placement\";s:5:\"label\";s:14:\"hide_on_screen\";a:1:{i:0;s:11:\"the_content\";}s:11:\"description\";s:0:\"\";}','Team Fields','team-fields','publish','close