,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=535',51,'coaches','',0),(537,1,'2020-06-17 23:53:12','2020-06-17 23:53:12','a:10:{s:4:\"type\";s:8:\"repeater\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:9:\"collapsed\";s:0:\"\";s:3:\"min\";s:0:\"\";s:3:\"max\";i:3;s:6:\"layout\";s:5:\"table\";s:12:\"button_label\";s:0:\"\";}','Coaches','coaches','publish','closed','closed','','field_5eeaab67c04cc','','','2020-06-17 23:53:12','2020-06-17 23:53:12','',531,'http://clubonevb.wpengine.com/?post_type=acf-field&p=537',1,'acf-field','',0),(538,1,'2020-06-17 23:53:12','2020-06-17 23:53:12','a:11:{s:4:\"type\";s:11:\"post_object\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:9:\"post_type\";a:1:{i:0;s:7:\"coaches\";}s:8:\"taxonomy\";s:0:\"\";s:10:\"allow_null\";i:0;s:8:\"multiple\";i:0;s:13:\"return_format\";s:6:\"object\";s:2:\"ui\";i:1;}','Coach','coach','publish','closed','closed','','field_5eeaacc0c04cd','','','2020-06-17 23:54:14','2020-06-17 23:54:14','',537,'http://clubonevb.wpengine.com/?post_type=acf-field&#038;p=538',0,'acf-field','',0),(539,1,'2020-07-28 00:37:13','2020-07-28 07:37:13','Tony started his volleyball coaching career in Southern California, where he enjoyed coaching all ages in his four seasons with Coast Volleyball Club. After moving his family to Arizona, Tony served as the JV head coach at Hamilton High School for four years. He then went on to launch Hamiltons beach volleyball program in 2016, where he was head coach of the Varsity squad for two years. Tony has trained athletes of all ages in both the indoor and beach game through school programs, club teams, and countless lessons, and his indoor club teams have earned three USAV GJNC bids to date.\r\n\r\nTony coaches because he loves teaching the sport, being part of the players journey, and having fun with them! He joined the Club One AZ coaching staff in 2016 because, in his words, Club One does a great job of building a culture of developing players and embracing the process.\r\n\r\nOutside of volleyball, Tony is an avid reader and loves to learn. He and his wife have two great kids, Austin and Kayla. When hes not coaching, Tony enjoys watching football, mountain biking, going on family trips, and spending quality time with his family.','Tony Lee','','publish','closed','closed','','tony-lee','','','2020-08-01 14:38:59','2020-08-01 21:38:59','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=539',48,'coaches','',0),(541,1,'2020-07-18 00:38:43','2020-07-18 07:38:43','Kayla has played volleyball for 13 years and has a passion and love for the game that has continued even after college. During her high school playing career in Arizona, Kayla and her Hamilton team finished state-runner-up twice and in the Final Four once, while her club teams placed first 2x and second 1x at the USAV Girls Junior National Championships. Kayla went on to play at Central Washington University as a RS/DS. After graduating from college, she coached club in Flagstaff for a year before joining the Club One AZ coaching staff in 2019.\r\n\r\nKayla coaches because she wants to pass on her love for the game to the next generation. Volleyball was a huge outlet for her in life and she wants it to be a safe place for other kids as well. She values Club One AZs perspective of We are One, in that the club wants players to receive the same training at each level, rather than each coach having a different way of doing things.\r\n\r\nOutside of volleyball, Kayla enjoys watching hockey, being with friends and family, and going country two-stepping on the weekends.','Kayla Banyai','','publish','closed','closed','','kayla-banyai','','','2020-08-01 14:37:21','2020-08-01 21:37:21','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=541',47,'coaches','',0),(543,1,'2020-07-22 00:40:42','2020-07-22 07:40:42','Larisa is a multi-tasker, who keeps God, family, and physical activity, as main courses on her daily menu. She has been coaching volleyball for over 14 years and looks forward to each season and the opportunity to grow the game, one kid at a time. She has a passion for quality skills training, as well as character building. She feels that sports are a wasted experience if there isn\'t learning and growth on all fronts: skills, character, and relationship building.\r\n\r\nLarisa\'s athletic career spans several decades in various sports, including high school and club volleyball, as well as softball, which she carried into college, playing at Cal Poly, San Luis Obispo. Most recently, her competitive bent has led her to more individual sports such as running and hiking. Her experience qualifying for the Boston Marathon taught her more about perseverance, goal setting, and hard work than all her other sports experiences combined!\r\n\r\nLarisa is the mother of one fun-loving, problem-solving son, and three wonderful, volleyball-playing daughters. When not multi-tasking to keep the wheels turning at home, work, and Club One AZ, she can be found visiting with her husband, David, or trekking up and down the trails of South Mountain Preserveher home away from home.','Larisa Ronda','','publish','closed','closed','','larisa-ronda','','','2020-08-06 14:27:30','2020-08-06 21:27:30','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=543',46,'coaches','',0),(544,1,'2020-06-18 00:40:06','2020-06-18 00:40:06','','IMG_4553','','inherit','open','closed','','img_4553','','','2020-06-18 00:40:06','2020-06-18 00:40:06','',543,'http://clubonevb.wpengine.com/wp-content/uploads/2020/06/IMG_4553.jpg',0,'attachment','image/jpeg',0),(545,1,'2020-06-18 00:40:46','2020-06-18 00:40:46','Larisa is a multi-tasker, who keeps God, family, and physical activity, as main courses on her daily menu. She has been coaching volleyball for over 14 years and looks forward to each season and the opportunity to grow the game, one kid at a time. She has a passion for quality skills training, as well as character building. She feels that sports are a wasted experience if there isn\'t learning and growth on all fronts: skills, character, and relationship building.\n\nLarisa\'s athletic career spans several decades in various sports, including high school and club volleyball, as well as softball, which she carried into college, playing at Cal Poly, San Luis Obispo. Most recently, her competitive bent has led her to more individual sports such as running and hiking. Her experience qualifying for the Boston Marathon taught her more about perseverance, goal setting, and hard work than all her other sports experiences combined!\n\nLarisa is the mother of one fun-loving, problem-solving son, and three wonderful, volleyball-playing daughters. When not multi-tasking to keep the wheels turning at home, work, and Club One AZ, she can be found visiting with her husband, David, or trekking up and down the trails of South Mountain Preserve  her home away from home. ','Larisa Ronda','','inherit','closed','closed','','543-autosave-v1','','','2020-06-18 00:40:46','2020-06-18 00:40:46','',543,'http://clubonevb.wpengine.com/543-autosave-v1/',0,'revision','',0),(546,1,'2020-06-18 00:44:33','2020-06-18 00:44:33','','17 Platinum','','publish','closed','closed','','17-platinum','','','2020-06-18 01:17:13','2020-06-18 01:17:13','',0,'http://clubonevb.wpengine.com/?post_type=teams&#038;p=546',3,'teams','',0),(547,1,'2020-06-18 00:48:10','2020-06-18 00:48:10','Regina Mannix is one of the most accomplished coaches and former players in Arizona. As the head volleyball coach at Scottsdale Community College since 1996, she has produced several NJCAA All-Americans and multiple ACCAC Players of the Year, and the program has enjoyed multiple region championships and nationals appearancesmost recently in 2019. As a coach, Regina is a four-time ACCAC Coach of the Year, a two-time AVCA Southwest Coach of the Year, a four-time NJCAA District Coach of the Year, and was named to the NJCAA Hall of Fame in 2008.\r\n\r\nDuring her own playing career, Regina was privileged to play under renowned volleyball coaches Brian Gimmillaro, Debbie Brown, and Sue Woodstra. While still in high school, she competed as a setter internationally in Finland, England, and Russia. As a senior, Mannix was named C.I.F. Co-Player of the Year and All-State, and she was also ranked second in the 1984 Volleyball Magazine \"Fab Fifty\" recruit list.\r\n\r\nRegina went on to compete for Arizona State University on scholarship as a setter, where she immediately set two new Sun Devil freshman records in aces per match and assists per match. Over the course of her four-year career at ASU, Regina racked up multiple tournament MVP awards, All-Conference honors in the PacWest and the Pac-10, and recognition as an NCAA All-American.\r\n\r\nRegina still holds five other records at ASU in addition to her two Freshman records: Two Single Match records for assists per match and aces per match, a Single Season record for aces in a season, and two Career records for total career assists and total career aces.\r\n\r\nRegina joined the Club One AZ coaching staff in 2019, and we are thrilled to add her expertise and experience to our dedicated lineup of coaches.\r\n\r\nRegina graduated from Arizona State University with a Bachelor of Science in Justice Administration and received her Masters in Counseling in the summer of 2001. She has two daughters, Riley and McKenna, with her husband Brian.','Regina Mannix','','trash','closed','closed','','regina-mannix__trashed','','','2020-08-13 14:47:13','2020-08-13 21:47:13','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=547',34,'coaches','',0),(549,1,'2020-07-02 04:52:21','2020-07-02 11:52:21','Arian has played volleyball since 2008, including four years at Hamilton High School and additional experience as a practice player with the ASU mens team. He and his team at Hamilton won the state championship his junior year, and Arian was named to the All-Section First Team and District First Team his senior year.\r\n\r\nArian coaches because he loves the game and loves sharing it with people who love to grow and learn. He believes there are certain things you can only learn through sports due to the mental and physical struggles throughout a season, and that using those struggles as a method of learning is extremely powerful for a players growth as a person.\r\n\r\nArian joined Club One AZ in 2016 not only because the coaching staff has talented coaches that he (or anyone) can learn from, but also because there is a certain familial aspect to being a part of the club that fascinates him the most. He comes from a culture where family is the biggest value, so to be a part of a club that resonates with his values is critical to who he is as a person and a coach.\r\n\r\nWhen hes not in the gym, Arian enjoys movies, video games, basketball, playing football, and spending time with friends and family.','Arian Bunthanom','','publish','closed','closed','','arian-bunthanom','','','2020-08-06 14:09:51','2020-08-06 21:09:51','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=549',45,'coaches','',0),(559,1,'2020-06-18 01:11:29','2020-06-18 01:11:29','','17 Gold','','publish','closed','closed','','17-gold','','','2020-08-28 16:31:32','2020-08-28 23:31:32','',0,'http://clubonevb.wpengine.com/?post_type=teams&#038;p=559',4,'teams','',0),(560,1,'2020-07-23 01:20:20','2020-07-23 08:20:20','Michael has been coaching volleyball since 2013 and has had opportunities to coach at many different levels for both boys and girls. He has coached both competitive and recreation middle school teams and has recently been coaching both the boys and girls freshmen teams at Perry High School. Michael was not a college volleyball playerbut he was a Division I college hockey player at Niagara University! During his freshman year, he and his team won their conference and earned an at-large bid to the national tournament, ultimately finishing eighth in the nation.\r\n\r\nOver the years, Michael has come to love the game and challenge that is volleyball. He coaches because he enjoys working with players and teams to develop individual skills that promote stronger and more competitive teams. Michael joined the Club One AZ coaching staff in 2018 because the club has a family environment that encourages players to develop as athletes and people.\r\n\r\nOutside of volleyball, Michael is a teacher and has found a love for working with others and helping them grow as people. He also enjoys DIY projects and carpentry, cycling and other work-outs, traveling, and spending time with his family and friends.','Michael Shannon','','publish','closed','closed','','michael-shannon','','','2020-08-01 14:38:15','2020-08-01 21:38:15','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=560',44,'coaches','',0),(562,1,'2020-07-19 01:23:29','2020-07-19 08:23:29','Kayleigh played college volleyball first at Trevecca Nazarene University in Nashville, Tennessee, where she was named captain as a sophomore and was awarded NCAA DII Defensive Player of the Year. While in Tennessee, she also assistant coached on various high school travel teams at a volleyball club in Nashville. After three years at TNU, Kayleigh then transferred to Point Loma Nazarene University in San Diego, California for her last year of college ball.\r\n\r\nKayleigh coaches because seeing the game develop in youth is something she craves to be a part of. She also coaches because the opportunity to mentor so many fantastic athletes is the best opportunity in the world. Kayleigh joined the Club One AZ coaching staff in 2019 because she had heard nothing but fantastic things about the clubs culture and development of players.\r\n\r\nOutside of volleyball, Kayleigh loves to play golf and spend time with her Frenchie, Torrey.','Kayleigh Jarrett','','publish','closed','closed','','kayleigh-jarrett','','','2020-08-01 14:37:28','2020-08-01 21:37:28','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=562',43,'coaches','',0),(564,1,'2020-07-15 01:24:06','2020-07-15 08:24:06','Jordan started coaching volleyball at her alma mater high school in Tennessee for two years before moving out to Arizona. During her senior year of high school, she and her team won the division championship, and during her second year of coaching at the school, they won it again!\r\n\r\nJordan coaches because she thinks volleyball is a great tool for learning many life lessons, and she loves to teach. She gets such a great feeling when she sees a player finally master a skill in a game that they have been working on for so long, and that feeling keeps her coming back. Jordan joined the Club One AZ coaching staff in 2018 and thinks the club is such a fun family to be a part ofeveryone is so helpful and so nice to interact with.\r\n\r\nOne of the things Jordan loves to do outside of volleyball is decorate a roomshe has lots of fun browsing through furniture and different art pieces, even if shes not buying anything!','Jordan Hill','','publish','closed','closed','','jordan-hill','','','2020-08-01 14:36:59','2020-08-01 21:36:59','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=564',41,'coaches','',0),(566,1,'2020-06-18 06:28:12','2020-06-18 06:28:12','','Clara Bednarek','','publish','closed','closed','','clara-bednarek','','','2020-06-18 06:28:12','2020-06-18 06:28:12','',0,'http://clubonevb.wpengine.com/?post_type=players&#038;p=566',0,'players','',0),(567,1,'2020-06-18 06:29:11','2020-06-18 06:29:11','','Abby Peterson','','publish','closed','closed','','abby-peterson','','','2020-07-20 16:48:49','2020-07-20 23:48:49','',0,'http://clubonevb.wpengine.com/?post_type=players&#038;p=567',0,'players','',0),(568,1,'2020-06-18 06:45:19','2020-06-1