ceholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";}','Join A Program Link','join_a_program_link','publish','closed','closed','','field_5efa22794cc11','','','2020-07-25 15:31:50','2020-07-25 22:31:50','',330,'http://clubonevb.wpengine.com/?post_type=acf-field&#038;p=745',29,'acf-field','',0),(746,1,'2020-06-29 17:25:02','2020-06-29 17:25:02','a:10:{s:4:\"type\";s:4:\"text\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:11:\"placeholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";}','Which Level? Link','which_level_link','publish','closed','closed','','field_5efa23e629da1','','','2020-07-24 22:49:52','2020-07-25 05:49:52','',488,'http://clubonevb.wpengine.com/?post_type=acf-field&#038;p=746',13,'acf-field','',0),(748,1,'2020-06-29 21:25:47','2020-06-29 21:25:47','','Team Fees Due','','inherit','closed','closed','','234-autosave-v1','','','2020-06-29 21:25:47','2020-06-29 21:25:47','',234,'http://clubonevb.wpengine.com/234-autosave-v1/',0,'revision','',0),(751,3,'2020-06-30 04:19:14','2020-06-30 04:19:14','[vc_row][vc_column][vc_single_image image=\"444\" img_size=\"full\"][vc_column_text]\r\n<h2>OUR STORY</h2>\r\n[/vc_column_text][vc_column_text]My wife, Larisa, and I have experienced the value that competitive sport offers, from our own college athletic endeavors as well as those of our daughters. We used this filter to help us in formulating the culture we hoped to embody in the organization we would start<strong>Club One AZ</strong>. It was the summer of 2010 and we were evaluating what next season would look like. After some deliberations we confirmed we wanted to begin a journey of building an organization that respected people as well as promoted competition. We wanted to make sure each individual knew they were valued, but we also understood that the individual is elevated most effectively in the context of team. Now, so many years into our journey, we have begun to see so many of the outcomes we had hoped forcamaraderie, trust, and teamtraits shaped by our motto <strong>We are one</strong>. And by \"we\", I mean a dedicated group of like-minded friendsour coaches at Club One AZ.\r\n\r\nWe dont venture to think we have arrived at our goals, but we do believe we are on our way to making a difference: a difference in the way player and parent are valued, a difference in the way coaches are developed, a difference in the way competition is advanced, and a difference in how success is achieved. We realize that our perspective may not align with everyones experiences, but we do believe that our goals bring out the best in people and prepare our athletes handsomely for the future that lie ahead of each of them.\r\n\r\nWe hope that you will choose to join us in this journey.\r\n\r\n&nbsp;\r\n\r\nDirectors, David &amp; Larisa Ronda[/vc_column_text][vc_single_image image=\"1435\" img_size=\"full\"][vc_column_text]\r\n<h2><strong>Vision</strong>:</h2>\r\nLeverage the sport of volleyball to develop competitive, service-minded athletes with strong character and a hunger to learn.\r\n<h2><strong>Mission</strong>:</h2>\r\nClub One has operated as a not-for-profit 501(c)(3) entity serving the volleyball community in Arizona since 2010. Through our club we strive to build:\r\n<ul>\r\n 	<li>Character through the challenges that training and competition provide.</li>\r\n 	<li>Systems of education that can be duplicated from one generation to the next.</li>\r\n 	<li>Futures for athletes who desire to compete at higher levels.</li>\r\n 	<li>Selflessness by nurturing an atmosphere of giving back some of what has been given to you.</li>\r\n</ul>\r\nTo achieve these goals, we endeavor to:\r\n<ul>\r\n 	<li>Provide the highest quality coaching in a challenging but nurturing environment.</li>\r\n 	<li>Develop a supportive and participatory relationship with our athletes and parents.</li>\r\n 	<li>Partner with organizations that can help us reach our ultimate goals of instilling character, competition, community, and learning.</li>\r\n</ul>\r\n<h2><strong>Values</strong>:</h2>\r\n<ul>\r\n 	<li>Excellence</li>\r\n 	<li>Integrity</li>\r\n 	<li>Respect</li>\r\n 	<li>Commitment</li>\r\n 	<li>Discipline</li>\r\n</ul>\r\n<h2><strong>Staff</strong>:</h2>\r\n<ul>\r\n 	<li>Larisa Ronda - Club One Director</li>\r\n 	<li>David Ronda - Club One Director</li>\r\n 	<li>Kelsey Girts - Club One Associate Director</li>\r\n 	<li>Ryan Wrublik - One Beach Director</li>\r\n 	<li>Lisa Naughton - Administrative Assistant</li>\r\n 	<li>Cassie Richardson - Communications Manager</li>\r\n</ul>\r\n[/vc_column_text][/vc_column][/vc_row]','About Us','','publish','closed','closed','','about-club-one-volleyball','','','2020-08-06 14:31:27','2020-08-06 21:31:27','',0,'http://clubonevb.wpengine.com/?page_id=751',0,'page','',0),(752,3,'2020-06-30 04:24:43','2020-06-30 04:24:43','[vc_row][vc_column][gravityform id=\"5\" title=\"false\" description=\"true\" ajax=\"false\"][/vc_column][/vc_row]','Contact Us','','publish','closed','closed','','contact-us','','','2020-08-01 12:46:26','2020-08-01 19:46:26','',311,'http://clubonevb.wpengine.com/?page_id=752',0,'page','',0),(754,3,'2020-06-30 13:23:03','2020-06-30 13:23:03',' ','','','publish','closed','closed','','754','','','2020-07-26 16:10:28','2020-07-26 23:10:28','',0,'http://clubonevb.wpengine.com/?p=754',43,'nav_menu_item','',0),(760,3,'2020-06-30 13:35:38','2020-06-30 13:35:38','We recommend trying both! Experience the difference between practicing in a gym vs. in the sun, playing a position vs. covering the whole court, jumping on hardwood vs. diving on sand. Some athletes have a clear preference for one over the other, but many enjoy training and competing in both sports. In fact, many college coaches (indoor and beach) prefer athletes who have played both sports until age 14 or 15, as it helps develop more well-rounded athletes.','When should I start playing indoor volleyball?','','publish','closed','closed','','when-should-i-start-playing-indoor-club-volleyball','','','2020-06-30 13:54:18','2020-06-30 13:54:18','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=760',0,'questions','',0),(761,3,'2020-06-30 13:36:32','2020-06-30 13:36:32','Ever since our inaugural club season, every Club One athlete with a desire to play at the college level has realized that dream. We have former Club One athletes competing at every level, from junior college to NCAA DI, and even professionally! For our current athletes with the same dream, we continue to provide support and help them receive exposure during the college recruiting process. You can find more details in our Recruiting FAQs.','Does Club One help athletes with college recruiting?','','publish','closed','closed','','does-club-one-help-athletes-with-college-recruiting-2','','','2020-06-30 13:45:09','2020-06-30 13:45:09','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=761',0,'questions','',0),(763,3,'2020-06-30 13:40:11','2020-06-30 13:40:11','We recommend playing one to two seasons in our Rec program and/or on your school team before committing to club volleyball. To have success in club, you should love the sport, have a passion for improving your skills, and be ready to compete as part of a team.','When should I start playing club volleyball?','','publish','closed','closed','','when-should-i-start-playing-club-volleyball-2','','','2020-06-30 13:40:15','2020-06-30 13:40:15','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=763',0,'questions','',0),(764,3,'2020-06-30 13:40:46','2020-06-30 13:40:46','Indoor volleyball teams have six players on the court at a time. Our indoor club and Rec teams field 10-12 athletes each to create an optimal practice environment. Beach volleyball teams compete as duos, just two players covering a slightly smaller court.','How many players are on a team?','','publish','closed','closed','','how-many-players-are-on-a-team','','','2020-06-30 13:40:46','2020-06-30 13:40:46','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=764',0,'questions','',0),(765,3,'2020-06-30 13:41:05','2020-06-30 13:41:05','We recommend participating in a One U clinic series and/or the Club One Rec program before trying out for a club team. This allows our coaches to determine whether you have a good foundation of proper skills and technique, and to help you develop in any areas that may be lacking.','Ive already played multiple seasons of YMCA volleyball. Am I ready to join a club team?','','publish','closed','closed','','ive-already-played-multiple-seasons-of-ymca-volleyball-am-i-ready-to-join-a-club-team','','','2020-06-30 13:43:39','2020-06-30 13:43:39','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=765',0,'questions','',0),(766,3,'2020-06-30 13:42:13','2020-06-30 13:42:13','<span style=\"font-weight: 400;\">No partner is needed to participate in One Beach training sessions, camps, or clinics. However, </span><span style=\"font-weight: 400;\">most</span><span style=\"font-weight: 400;\"> One Beach tournaments require you to sign up with a designated partner. </span><span style=\"font-weight: 400;\">Most athletes will find good partner options for tournaments in their regular season training groups.</span>','Do I need to have a partner to participate in One Beach?','','publish','closed','closed','','do-i-need-to-have-a-partner-to-participate-in-one-beach','','','2020-07-01 18:12:17','2020-07-01 18:12:17','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=766',0,'questions','',0),(767,3,'2020-06-30 13:42:32','2020-06-30 13:42:32','There are many differences between these two sports! Here are just a few: beach volleyball teams have two players, while indoor teams have six on the court; the ball used in beach volleyball is slightly larger than the ball used for indoor; and the beach volleyball court is slightly smaller than the indoor court.','Whats the difference between beach and indoor volleyball?','','publish','closed','closed','','whats-the-difference-between-beach-and-indoor-volleyball','','','2020-06-30 13:42:32','2020-06-30 13:42:32','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=767',0,'questions','',0),(768,3,'2020-06-30 13:42:49','2020-06-30 13:42:49','Our Select training groups are for highly committed athletes who desire to play beach volleyball beyond high school. Our Experienced training groups prepare athletes to compete in tournaments or for a spot on their high school beach team, with the understanding that they may also have commitments in other sports or activities. Our Beginner training groups are all about introducing beach volleyball to kids ages eight to twelve.','Whats the difference between the Select, Experienced, and Beginner training groups?','','publish','closed','closed','','whats-the-difference-between-the-select-experienced-and-beginner-training-groups','','','2020-06-30 13:42:49','2020-06-30 13:42:49','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=768',0,'questions','',0),(770,3,'2020-06-30 13:43:09','2020-06-30 13:43:09','This is a very important question! To have an enjoyable and safe experience, we recommend you bring: lots of water, sunglasses, sand socks (for hot and cold conditions), a visor or baseball cap, sunscreen, a towel, sweatpants (for cloudy days or when the sun gets low), and a sports drink or snack.','What should I bring to a beach volleyball practice or tournament?','','publish','closed','closed','','what-should-i-bring-to-a-beach-volleyball-practice-or-tournament','','','2020-06-30 13:43:09','2020-06-30 13:43:09','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=770',0,'questions','',0),(772,3,'2020-06-30 13:43:56','2020-06-30 13:43:56','Yes, we welcome all volleyball athletes at our public events! Come learn, compete, and have a blast!','Im not a Club One athlete. Am I allowed to participate in Club One events?','','publish','closed','closed','','im-not-a-club-one-athlete-am-i-allowed-to-participate-in-club-one-events','','','2020-06-30 13:43:56','2020-06-30 13:43:56','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=772',0,'questions','',0),(773,3,'2020-06-30 13:44:28','2020-06-30 13:44:28','We host pre-tryout activities after the end of school season up until girls club tryouts, which take place in November.','When does club volleyball season start?','','publish','closed','closed','','when-does-club-volleyball-season-start-2','','','2020-06-30 13:44:28','2020-06-30 13:44:28','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=773',0,'questions','',0),(774,3,'2020-06-30 13:44:52','2020-06-30 13:44:52','Our club fees are all-inclusive, which means we build in all associated costs from day one, including uniforms, travel expenses, tournaments, and more. Club fees do vary based on age level and whether the team is a Region or National level team. We post all fees on our Teams page each year before club tryouts.','How much does club volleyball cost?','','publish','closed','closed','','how-much-does-club-volleyball-cost','','','2020-06-30 13:44:52','2020-06-30 13:44:52','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=774',0,'questions','',0),(775,3,'2020-06-30 13:45:50','2020-06-30 13:45:50','We have nets, court space, and LOTS of volleyballs on hand for every training event! We recommend wearing athletic clothes, plus kneepads and court shoes for Indoor training, or sunglasses and a towel for Beach training. Be sure to bring plenty of water as well, especially for Beach training, which takes place outdoors.','What equipment do I need for training? Should I bring my own ball?','','publish','closed','closed','','what-equipment-do-i-need-for-training-should-i-bring-my-own-ball','','','2020-06-30 13:45:50','2020-06-30 13:45:50','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=775',0,'questions','',0),(776,3,'2020-06-30 13:46:40','2020-06-30 13:46:40','We recommend participating in multiple One U clinic series before signing up for SGT. This helps coaches determine whether you have the proper skills foundation for a beneficial SGT experience.','Ive already played multiple seasons of YMCA volleyball. Should I sign up for One U or Small Group Training (SGT)?','','publish','closed','closed','','ive-already-played-multiple-seasons-of-ymca-volleyball-should-i-sign-up-for-one-u-or-small-group-training-sgt','','','2020-06-30 13:46:40','2020-06-30 13:46:40','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=776',0,'questions','',0),(777,3,'2020-06-30 13:46:59','2020-06-30 13:46:59','The cost of private lessons varies based on a few factors: coachs experience, number of participants, and court rental rate. Once we connect you with a coach for lessons, be sure to ask them about their rate. Most coaches prefer to receive payment via cash or check.','How much are Private Lessons? Can I pay with a credit card?','','publish','closed','closed','','how-much-are-private-lessons-can-i-pay-with-a-credit-card','','','2020-06-30 13:46:59','2020-06-30 13:46:59','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=777',0,'questions','',0),(778,3,'2020-06-30 13:47:19','2020-06-30 13:47:19','Sometimesspace is limited, especially at One U and SGT events, so we cant guarantee there will always be room for walk-ups. We recommend signing up online in advance to reserve your spot before the session fills up.','Do you allow walk-up registrations at Training events?','','publish','closed','closed','','do-you-allow-walk-up-registrations-at-training-events','','','2020-06-30 13:47:19','2020-06-30 13:47:19','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=778',0,'questions','',0),(779,3,'2020-06-30 13:47:39','2020-06-30 13:47:39','Parents are always welcome to stay and observe! We only ask that you leave the coaching and instruction to the coaches. If your child is distracted by your presence, we encourage you to use the time to run errands, meet up with a friend, or treat yourself :-)','Are parents allowed to watch at Training events?','','publish','closed','closed','','are-parents-allowed-to-watch-at-training-events','','','2020-06-30 13:47:39','2020-06-30 13:47:39','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=779',0,'questions','',0),(780,3,'2020-06-30 13:48:24','2020-06-30 13:48:24','While many of our coaches are also part of accomplished school programs, we have several high-level head coaches who only coach at the club level. We also welcome novice volleyball coaches as assistants. To be a Club One coach, you should have 1) volleyball experience as a coach and/or competitive athlete and 2) a continual desire to learn and grow in your game knowledge, teaching ability, strategic insight, and people skills.','Do I have to be a high school or middle school coach to coach a club team?','','publish','closed','closed','','do-i-have-to-be-a-high-school-or-middle-school-coach-to-coach-a-club-team','','','2020-06-30 13:48:24','2020-06-30 13:48:24','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=780',0,'questions','',0),(781,3,'2020-06-30 13:48:39','2020-06-30 13:48:39','We encourage our coaches to pursue professional and personal development opportunities throughout their lives. Our preseason orientation includes in-depth training in practice planning, proper volleyball technique, game management, communication skills, and more. We provide mid-season coach growth opportunities on various topics for both large and small groups. We also frequently cover registration expenses for coaches to attend pre-approved coaching clinics, both local and out-of-state.','What training do you offer for club coaches?','','publish','closed','closed','','what-training-do-you-offer-for-club-coaches','','','2020-06-30 13:48:39','2020-06-30 13:48:39','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=781',0,'questions','',0),(782,3,'2020-06-30 13:48:57','2020-06-30 13:48:57','We have several coaches with extensive beach and indoor experience who coach our athletes in both sports. We will always consider dual-sport coaches if your level of experience qualifies you to coach in both programs.','Do you allow coaches to coach both indoor and beach?','','publish','closed','closed','','do-you-allow-coaches-to-coach-both-indoor-and-beach','','','2020-06-30 13:48:57','2020-06-30 13:48:57','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=782',0,'questions','',0),(783,3,'2020-06-30 13:49:15','2020-06-30 13:49:15','Coaches pay varies based on several factors: position (head coach or assistant), age and level of team, amount of travel/time commitment required, and level of coaching experience. Some of our coaches also provide private training as an additional source of income, and we promote them to our athletes and others.','How much are Club One coaches paid?','','publish','closed','closed','','how-much-are-club-one-coaches-paid','','','2020-06-30 13:49:15','2020-06-30 13:49:15','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=783',0,'questions','',0),(785,3,'2020-06-30 13:49:37','2020-06-30 13:49:37','Upon being hired, coaches must complete the certifications associated with membership in the Arizona Region of USA Volleyball. Club One reimburses the cost of any membership fees, certifications, or renewals.','What certifications are required to be a Club One coach?','','publish','closed','closed','','what-certifications-are-required-to-be-a-club-one-coach','','','2020-06-30 13:49:37','2020-06-30 13:49:37','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=785',0,'questions','',0),(786,3,'2020-06-30 13:55:43','2020-06-30 13:55:43','We recommend playing one to two seasons in our Rec program and/or on your school team before committing to indoor club volleyball. To have success in club, you should love the sport, have a passion for improving your skills, and be ready to compete as part of a team.','When should I start playing indoor club volleyball?','','publish','closed','closed','','when-should-i-start-playing-indoor-club-volleyball-2','','','2020-06-30 13:55:43','2020-06-30 13:55:43','',0,'http://clubonevb.wpengine.com/?post_type=questions&#038;p=786',0,'questions','',0),(787,1,'2020-06-30 15:44:20','2020-06-30 15:44:20','a:10:{s:4:\"type\";s:4:\"text\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:11:\"placeholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";}','Join A Program Header','join_a_program_header','publish','closed','closed','','field_5efb5db5c6983','','','2020-07-25 15:31:50','2020-07-25 22:31:50','',330,'http://clubonevb.wpengine.com/?post_type=acf-field&#038;p=787',27,'acf-field','',0),(788,1,'2020-06-30 15:44:20','2020-06-30 15:44:20','a:10:{s:4:\"type\";s:8:\"textarea\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:11:\"placeholder\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";s:4:\"rows\";i:3;s:9:\"new_lines\";s:0:\"\";}','Join A Program Description','join_a_program_description','publish','closed','closed','','field_5efb5da1c6982','','','2020-07-25 15:31:50','2020-07-25 22:31:50','',330,'http://clubonevb.wpengine.com/?post_type=acf-field&#038;p=788',28,'acf-field','',0),(789,1,'2020-06-30 15:48:33','2020-06-30 15:48:33','a:10:{s:4:\"type\";s:4:\"text\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_v