ience at Club Oneits a highly competitive, yet caring and fun environment that promotes teamwork, family and values. Its the whole package.</i></strong>','Connie S.','','publish','closed','closed','','connie-s','','','2020-07-01 05:13:50','2020-07-01 05:13:50','',0,'http://clubonevb.wpengine.com/?post_type=testimonials&#038;p=800',0,'testimonials','',0),(801,2,'2020-07-01 05:14:14','2020-07-01 05:14:14','<strong>Coaches and directors are excellent. Weve been part of the Club One family for years now! Thanks for the memories.</strong>','Stacy B.','','publish','closed','closed','','stacy-b','','','2020-07-01 05:14:14','2020-07-01 05:14:14','',0,'http://clubonevb.wpengine.com/?post_type=testimonials&#038;p=801',0,'testimonials','',0),(803,2,'2020-07-01 13:50:31','2020-07-01 13:50:31','','12 Blue','','publish','closed','closed','','12-blue','','','2020-08-28 17:01:32','2020-08-29 00:01:32','',0,'http://clubonevb.wpengine.com/?post_type=teams&#038;p=803',24,'teams','',0),(804,2,'2020-07-01 13:51:51','2020-07-01 13:51:51','','12 Silver','','publish','closed','closed','','12-silver','','','2020-08-28 16:30:31','2020-08-28 23:30:31','',0,'http://clubonevb.wpengine.com/?post_type=teams&#038;p=804',23,'teams','',0),(805,2,'2020-07-01 13:57:52','2020-07-01 13:57:52','','14 Red','','publish','closed','closed','','14-red','','','2020-08-28 16:00:34','2020-08-28 23:00:34','',0,'http://clubonevb.wpengine.com/?post_type=teams&#038;p=805',16,'teams','',0),(806,2,'2020-07-01 13:57:19','2020-07-01 13:57:19','','14 Yellow','','publish','closed','closed','','14-yellow','','','2020-08-28 15:59:54','2020-08-28 22:59:54','',0,'http://clubonevb.wpengine.com/?post_type=teams&#038;p=806',14,'teams','',0),(807,2,'2020-07-01 13:55:03','2020-07-01 13:55:03','','13 Gold','','publish','closed','closed','','13-gold','','','2020-08-28 17:01:53','2020-08-29 00:01:53','',0,'http://clubonevb.wpengine.com/?post_type=teams&#038;p=807',20,'teams','',0),(808,2,'2020-07-01 13:56:26','2020-07-01 13:56:26',''