1 18:06:39','One Beach Volleyball | Private & Small Group Lessons','One Beach Volleyball | Private & Small Group Lessons','','inherit','open','closed','','img_5324','','','2020-07-01 18:07:08','2020-07-01 18:07:08','',15,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/IMG_5324.jpg',0,'attachment','image/jpeg',0),(859,2,'2020-07-01 18:08:35','2020-07-01 18:08:35','One Beach Volleyball | Beach Events','One Beach Volleyball | Beach Events','','inherit','open','closed','','20200618095647_img_6860','','','2020-07-01 18:08:52','2020-07-01 18:08:52','',15,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/20200618095647_IMG_6860.jpg',0,'attachment','image/jpeg',0),(861,2,'2020-07-01 18:16:57','2020-07-01 18:16:57','','beach-club','','inherit','open','closed','','img_6088','','','2020-07-01 18:17:04','2020-07-01 18:17:04','',12,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/IMG_6088.jpg',0,'attachment','image/jpeg',0),(863,2,'2020-07-01 18:42:38','2020-07-01 18:42:38','','we-are-one','','inherit','open','closed','','20200618094512_img_6803','','','2020-07-01 18:42:50','2020-07-01 18:42:50','',7,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/20200618094512_IMG_6803.jpg',0,'attachment','image/jpeg',0),(864,2,'2020-07-01 19:15:23','2020-07-01 19:15:23','At Club One, we frequently offer <strong>Small Group Training (SGT) sessions </strong>during the off-season for athletes seeking positional skills training and quality reps.\r\n\r\nOur coaches train just one or two skills each sessionfor example, Serving &amp; Passing, or Attacking. To create a \"Small Group\" environment, each session has a player-to-coach ratio of no more than 7:1. This also helps us maintain social distancing and other safety measures in our gym.\r\n\r\nDuring SGT, one to two Club One coaches will work with the group to break down the featured skill(s) into its basic components. They give each athlete targeted feedback and instruction every step of the way. Athletes then have opportunities to implement that feedback through practice and repetitions throughout the session.\r\n\r\nWe tailor these sessions to<strong>experienced volleyball athletes</strong> who have at least one season of club competition under their belts. Athletes from any club are welcome.\r\n\r\nIf your athlete wants to develop proper technique, grow in confidence, and excel in specific skills, sign them up for Small Group Training this summer! See our <a href=\"https://cluboneaz.com/club-one-events/\">Events page</a> for all the details.','What is \"Small Group Training\"?','','inherit','closed','closed','','426-autosave-v1','','','2020-07-01 19:15:23','2020-07-01 19:15:23','',426,'http://clubonevb.wpengine.com/426-autosave-v1/',0,'revision','',0),(865,2,'2020-07-01 18:54:40','2020-07-01 18:54:40','','attacking','','inherit','open','closed','','2017-07-01-27267-dsc_5009-final','','','2020-07-01 18:54:58','2020-07-01 18:54:58','',426,'http://clubonevb.wpengine.com/wp-content/uploads/2020/06/2017-07-01-27267-DSC_5009-final.jpg',0,'attachment','image/jpeg',0),(866,2,'2020-07-01 19:11:50','2020-07-01 19:11:50','','setting','','inherit','open','closed','','2017-07-02-27745-dsc_6419-final','','','2020-07-01 20:38:00','2020-07-01 20:38:00','',426,'http://clubonevb.wpengine.com/wp-content/uploads/2020/06/2017-07-02-27745-DSC_6419-final.jpg',0,'attachment','image/jpeg',0),(868,2,'2020-07-04 18:26:05','2020-07-04 18:26:05','<blockquote><em><b>\"</b>People with a growth mindset believe that skills and intelligence are grown and developed. So, people who are \'good \'at something, are \'good\' because they built that ability, and people who aren\'t, are \'not good\' because they haven\'t done the work.\"</em></blockquote>\r\nAt Club One and One Beach, we talk a lot about having a <strong>Growth Mindset</strong>not only with our players, but with our coaching staff as well!\r\n\r\nWe believe that the biggest factor in either achieving or limiting our potential is our own effort and mentality. With that in mind, we challenge each other regularly to believe that improvement is always within our reach.\r\n\r\nTo read more about this topic, check out<a href=\"https://thelearnerlab.com/growth-mindset/\" target=\"_blank\" rel=\"noopener noreferrer\"><strong>The Learner Lab</strong></a>. They\'ve created some great videos and other content to help you understand the process of how a Growth Mindset impacts the way we learn and train.','How to Have a Growth Mindset','','inherit','closed','closed','','431-autosave-v1','','','2020-07-04 18:26:05','2020-07-04 18:26:05','',431,'http://clubonevb.wpengine.com/431-autosave-v1/',0,'revision','',0),(869,2,'2020-07-01 19:32:24','2020-07-01 19:32:24','<blockquote><em>\"By the time youve walked into the gym for volleyball tryouts, your game is your game. Youve practiced. Youve trained. Youve arrived at the gym on time  or at least you better have. And youre definitely not walking in head down, eyes glued to your phone, right?</em>\r\n\r\n<em>Right!</em>\r\n\r\n<em>So pretty much all thats left is to do your best. But there is one thing you can still control.</em>\r\n\r\n<em>Body language.\"</em></blockquote>\r\nDid you know our coaches evaluate an athlete\'s <strong>body language</strong> just as much as their volleyball skill?\r\n\r\nAt Pre-Tryout events and on Tryout Day, coaches observe how athletes <strong>react </strong>to errors, how they <strong>interact </strong>with teammates, how they <strong>respond </strong>to feedback &amp; instruction, and more.\r\n\r\nThankfully, adjusting your body language is a lot easier than learning a new volleyball skill. And as this article points out, good body language has lots of benefits!\r\n<ul>\r\n 	<li>It increases yourconfidence, creating a more enjoyable tryout process.</li>\r\n 	<li>It has a positive impact on those playing around you.</li>\r\n 	<li>It helps you stand out!</li>\r\n</ul>\r\n<div><a href=\"https://www.theartofcoachingvolleyball.com/want-to-make-the-team-wear-your-winners-face/\" target=\"_blank\" rel=\"noopener noreferrer\">Read the full blog post here</a>, and check out <a href=\"https://www.theartofcoachingvolleyball.com/category/quick-take-blog/\" target=\"_blank\" rel=\"noopener noreferrer\">The Art of Coaching Volleyball</a> for more resources like this one.</div>','What We Did With Our 8th Grade Girls Basketball Team','','inherit','closed','closed','','430-autosave-v1','','','2020-07-01 19:32:24','2020-07-01 19:32:24','',430,'http://clubonevb.wpengine.com/430-autosave-v1/',0,'revision','',0),(871,2,'2020-07-01 19:50:19','2020-07-01 19:50:19','Club One athletes go on to compete at every level, from junior college to NCAA DI (and even professionally!). Each December, it warms our hearts to see so many of them back in the gym for our annual Alumni Night celebration.\r\n\r\nThe evening starts with a Recruiting Seminar and Alumni Q&amp;A session. For Club One athletes interested in playing at the next level, each alumni panel proves to be a valuable resource. Alumni from a variety of college programs share their recruiting experiences and answer frequently asked questions about life as a college athlete.\r\n\r\nThen, the first whistle blows to start a series oftimed, round robin scrimmages between our high school National teams and multiple teams of alumni. It\'s a night of fierce but friendly competition between former and current Club One athletes!\r\n\r\nWe do our best to reach out to each alumni personally in the weeks leading up to this special event. All alumni are welcome, whether to play or just to hang out!\r\n\r\nVisit our <a href=\"/alumni/\">Alumni page</a> to see where our athletes have gone on to compete over the years.','Alumni Night: A Club One Tradition','','inherit','closed','closed','','424-autosave-v1','','','2020-07-01 19:50:19','2020-07-01 19:50:19','',424,'http://clubonevb.wpengine.com/424-autosave-v1/',0,'revision','',0),(873,2,'2020-07-01 20:00:35','2020-07-01 20:00:35','There\'s tons of research available showing the impact of nutrition on an athlete\'s energy leveland performance,from grade school to the pros.\r\n\r\nOn tournament days, ourathletes need to eat small, frequent meals and drink plenty of fluids.They already have so many other things to focus on during the tournament, including technique, strategy, communication, body language, and more. Let\'s make it easieron them by providing healthy foods for preparation, energy, and recovery!\r\n\r\n<strong>Team Table DOs</strong>\r\n<ul>\r\n 	<li>Pasta salad</li>\r\n 	<li>Yogurt (vanilla or strawberry)</li>\r\n 	<li>Bagels (halved or quartered) w/ cream cheese</li>\r\n 	<li>Whole grain wraps or sandwiches with lean meats (ham, roast beef, turkey)</li>\r\n 	<li>FRUIT! (strawberries, apples, grapes, oranges, watermelon)</li>\r\n 	<li>VEGGIES! (Carrots, celery, broccoli)</li>\r\n 	<li>Granola bars,power bars, or protein balls</li>\r\n 	<li>Animal crackers or whole grain crackers</li>\r\n 	<li>Nuts (peanuts, walnuts, almonds)</li>\r\n 	<li>Lightly salted pretzels or baked chips</li>\r\n 	<li>WATER, low-fat chocolate milk, coconut water, andsmall gatorades (limit the gatorade intake for young athletes)</li>\r\n</ul>\r\n<strong>Team Table DON\'Ts</strong>\r\n<ul>\r\n 	<li>Fast food or fried food (these itemstake too long to digest)</li>\r\n 	<li>High sugar foods (donuts, candy bars, fruit roll-ups)</li>\r\n 	<li>Cheese platters (can cause constipation)</li>\r\n 	<li>\"Empty\" calories(popcorn, potato chips, Cheez-Its, Ritz Bits)</li>\r\n 	<li>Soda, Vitamin Water, energy drinks,fruit juice (100% fruit juice is okay if diluted with 1/2 water)</li>\r\n</ul>\r\nFor more information on foods to eat before, during, and after competition or other physical activity, check out these resources!\r\n<ul>\r\n 	<li>Recipes, facts, and tips from<a href=\"https://truesport.org/true-food/true-food-facts-tips/\" target=\"_blank\" rel=\"noopener noreferrer\">TrueFood</a>(part of<a href=\"https://truesport.org\" target=\"_blank\" rel=\"noopener noreferrer\">TrueSport.org</a>)</li>\r\n 	<li><a href=\"https://www.theartofcoachingvolleyball.com/5-essential-nutrition-tips-for-volleyball-players/\" target=\"_blank\" rel=\"noopener noreferrer\">Interview</a> with the Director of Nutrition for Penn State Volleyball</li>\r\n 	<li>A day-in-the-life example of healthy meals and snacks from <a href=\"https://www.teamusa.org/USA-Volleyball/Features/2014/March/05/Serving-the-Ideal-Diet-for-Training-Competition-and-Recovery\" target=\"_blank\" rel=\"noopener noreferrer\">Team USA Volleyball</a></li>\r\n</ul>','Proper Nutrition for Tournament Days','','inherit','closed','closed','','423-autosave-v1','','','2020-07-01 20:00:35','2020-07-01 20:00:35','',423,'http://clubonevb.wpengine.com/423-autosave-v1/',0,'revision','',0),(875,2,'2020-07-01 20:08:35','2020-07-01 20:08:35','<div>\r\n\r\nIf you\'re interested in college volleyball, it\'s your responsibility to start communicating with college coaches! Club One and One Beach are here to support you every step of the way.\r\n\r\n<a href=\"https://www.theartofcoachingvolleyball.com/why-you-need-to-email-college-coaches-and-how-to-do-it/\" target=\"_blank\" rel=\"noopener noreferrer\">Read this blog article</a> to gethelpful tips for email communication with college coaches,such as:\r\n\r\n</div>\r\n<ul>\r\n 	<li>Why you need to initiate contact</li>\r\n 	<li>Where to find coaches\' contact info</li>\r\n 	<li>How to write yoursubject line</li>\r\n 	<li>How tointroduce yourself</li>\r\n 	<li>What questions to ask</li>\r\n 	<li>When to send check-in and follow-up emails</li>\r\n</ul>\r\n<div>If you signed up for the <a href=\"https://universityathlete.com/#/\" target=\"_blank\" rel=\"noopener noreferrer\">University Athlete</a> upgrade provided by Club One, you can use these tips to message coaches through the University Athlete platform.</div>\r\n<div><span style=\"font-weight: 400;\">Ever since our inaugural season, </span><span style=\"font-weight: 400;\">every Club One and One Beach athlete with the desire to play at the collegiate level has gone on to realize that dream. If that\'s your goal, you can do it, too!</span></div>\r\n<div></div>\r\n<div>For additional recruiting support this season, talk to your coaches and email us at <a href=\"mailto:info@cluboneaz.com\" target=\"_blank\" rel=\"noopener noreferrer\">info@cluboneaz.com</a>.</div>','How to Email College Coaches','','inherit','closed','closed','','422-autosave-v1','','','2020-07-01 20:08:35','2020-07-01 20:08:35','',422,'http://clubonevb.wpengine.com/422-autosave-v1/',0,'revision','',0),(877,2,'2020-06-29 12:30:29','2020-06-29 12:30:29','If you want to see huge growth in your game, use some of your time at home to watch and learn from great volleyball athletes.\r\n\r\nOn the <a href=\"https://www.youtube.com/channel/UC0ttOT9ntctdyZmLKWYg5jw\" target=\"_blank\" rel=\"noopener noreferrer\">Club One AZ YouTube channel</a>, we\'ve curated a <a href=\"https://www.youtube.com/playlist?list=PL7csvsJZzHlrP4pWXOlaAqnJafPyMdhrz\" target=\"_blank\" rel=\"noopener noreferrer\">playlist featuring Great Matches</a>from the International, NCAA, Community College,and High School levels.\r\n\r\nTake a break from binging your favorite show to watch one of these matches and study specific players. Pick one of the bullets below and ask yourself those same questions throughout the match.\r\n<ul>\r\n 	<li>Who is playing your position? What are they doing well?</li>\r\n 	<li>Who is excelling in a skill you want to get better at? What do you notice about the way they play?</li>\r\n 	<li>What plays stand out to you? Can you visualize yourself making that same play?</li>\r\n 	<li>What areas areopen on the court? Where would you hit or serve if you were trying to score?</li>\r\n</ul>\r\nYou\'ll be amazed to see what you learn by watching closely!','How to Watch Great Volleyball Matches','','publish','open','open','','how-to-watch-great-volleyball-matches','','','2020-07-04 18:16:55','2020-07-04 18:16:55','',0,'http://clubonevb.wpengine.com/?p=877',0,'post','',0),(882,2,'2020-07-01 20:28:51','2020-07-01 20:28:51','','one-u-beach','','inherit','open','closed','','img_0589','','','2020-07-01 20:28:58','2020-07-01 20:28:58','',240,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/IMG_0589.jpg',0,'attachment','image/jpeg',0),(884,2,'2020-07-01 20:37:25','2020-07-01 20:37:25','','training-block-4','','inherit','open','closed','','2017-07-02-27745-dsc_6419-finalsmall','','','2020-07-01 20:43:27','2020-07-01 20:43:27','',240,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/2017-07-02-27745-DSC_6419-finalSMALL.jpg',0,'attachment','image/jpeg',0),(885,2,'2020-07-01 20:38:49','2020-07-01 20:38:49','','training-block-1','','inherit','open','closed','','img_0589small','','','2020-07-01 20:39:16','2020-07-01 20:39:16','',240,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/IMG_0589SMALL.jpg',0,'attachment','image/jpeg',0),(886,2,'2020-07-01 20:41:54','2020-07-01 20:41:54','','training-block-3','','inherit','open','closed','','img_5971','','','2020-07-01 20:43:15','2020-07-01 20:43:15','',240,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/IMG_5971.jpg',0,'attachment','image/jpeg',0),(892,2,'2020-07-02 21:20:13','2020-07-02 21:20:13','[vc_row][vc_column][gravityform id=\"4\" title=\"false\" description=\"true\" ajax=\"false\"][/vc_column][/vc_row]','Private Lesson Request','','publish','closed','closed','','private-lesson-request','','','2020-08-01 12:49:39','2020-08-01 19:49:39','',311,'http://clubonevb.wpengine.com/?page_id=892',0,'page','',0),(897,2,'2020-07-02 22:48:28','2020-07-02 22:48:28','','start-small','','inherit','open','closed','','20200201135447_img_4433small','','','2020-07-02 22:48:40','2020-07-02 22:48:40','',326,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/20200201135447_IMG_4433SMALL.jpg',0,'attachment','image/jpeg',0),(898,2,'2020-07-02 22:50:57','2020-07-02 22:50:57','','giv