07-31#038;p=1010',0,'tribe_events','',0),(1013,2,'2020-07-13 22:06:12','2020-07-13 22:06:12','Learn how to play volleyball with us!\n<ul>\n 	<li>Designed for Beginner level players, grades 4-6th or 6-8th, who fit the self-assessment criteria below</li>\n 	<li>Perfect for players with <strong>up to 1 year</strong> of club experience</li>\n 	<li><strong>Self-Assessment for One U:</strong>\n<ul>\n 	<li>Athlete successfullyoverhand serves <strong>less than</strong> 50% of the time</li>\n 	<li>Athlete can self-pass <strong>less than</strong> 20 times consecutively</li>\n 	<li>Athlete is <strong>not yet familiar</strong> with or proficient in the proper footwork or mechanics for hitting and setting</li>\n</ul>\n</li>\n</ul>\nSign up here!\n\n&nbsp;','One U Clinic','','inherit','closed','closed','','1010-autosave-v1','','','2020-07-13 22:06:12','2020-07-13 22:06:12','',1010,'http://clubonevb.wpengine.com/1010-autosave-v1/',0,'revision','',0),(1015,2,'2020-07-03 23:39:34','2020-07-04 06:39:34','Bri is an Arizona native and an alumni of Corona del Sol HS and Arizona State University. She received her undergraduate degree in Criminal Justice with a minor in Business . Bri grew up in a volleyball family, starting to play herself at age 7, and fell in love with the sport. She began playing at Club One AZ during our inaugural season in 2010 and joined our coaching staff the following year.\r\n\r\nBri also coaches in our One Beach program, helping run our sand tournaments, and has been an assistant coach for boys program over the years. And because she can\'t get enough, she coaches both boys and girls volleyball at Corona del Sol. In her free time, she likes to play sand volleyball and games with her friends. Bri is excited to continue teaching young athletes the skills of volleyball and sharing her love of the game with them.','Bri Keller-Galley','','publish','closed','closed','','bri-keller-galley','','','2020-08-01 14:40:24','2020-08-01 21:40:24','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1015',42,'coaches','',0),(1018,2,'2020-07-04 23:42:45','2020-07-05 06:42:45','Brian has been coaching high school and club volleyball in Arizona since 2003. He is currently the Varsity girls assistant at Perry High School. Brian also started his playing career here in Arizona at Mountain Pointe High School under Fred Mann. In 1999, he and his team won the state championship and Brian was awarded Player of the Year. He went on to play DI college ball, first at Loyola Marymount, and then at Pepperdine University under legendary Hall of Fame coach Marv Dunphy. While at Pepperdine, Brian was a part of a national runner-up team in 2002 and a Final Four team in 2003.\r\n\r\nBrian coaches because he loves the sport of volleyball. He loves to encourage young athletes and to challenge them to always find ways to grow, both on and off the volleyball court. Brian chose to coach with and have his daughter play at Club One AZ in 2017 because the vision and purpose of the club is very intentionally bigger than volleyball. In his words, we care about the volleyball (and winning) but we also see that, in the grand scheme of things, the relationships built here can be difference-makers in the lives of the families that call Club One AZ home.\r\n\r\nBrians #1 priority when hes not working or coaching is spending time with his wife, Nicole, and their three awesome kids: Kate, Everett, and Grant.','Brian Wagner','','publish','closed','closed','','brian-wagner','','','2020-08-01 14:35:54','2020-08-01 21:35:54','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1018',40,'coaches','',0),(1020,2,'2020-07-05 15:46:51','2020-07-05 22:46:51','Cassie played four years of Division I volleyball at the University of Denver from 2010-2013, as both an OH and RS. She successfully recovered from a season-ending ACL injury sustained during the first match of her freshman year and went on to receive the Most Improved Player award her senior year. In high school, Cassie and her team at Corona del Sol High School finished state runner-up in 2009.\r\n\r\nCassie coaches because she believes sport is a powerful tool for building character, teaching discipline, and instilling values in young people. She believes she would not be the person she is today if it werent for the lessons she learned through playing a competitive sportthe good lessons, the hard lessons, and everything in between.\r\n\r\nAfter her parents founded Club One AZ in 2010, large portions of Cassies summer and winter breaks were spent helping with various admin and coaching tasks at the club. She officially joined the Club One AZ coaching staff in 2014 and was thrilled to joined the administrative staff full-time in 2019. She has played and coached in many different places and has never encountered a culture as special and purposeful as the one created here at Club One AZ.\r\n\r\nOutside of volleyball, Cassie enjoys spending quality time with her husband and their Catahoula dog, Teddy. She also loves hanging out with her family, getting to know God through His Word and His people, and playing the piano :-)','Cassie Richardson','','publish','closed','closed','','cassie-richardson','','','2020-08-06 14:13:11','2020-08-06 21:13:11','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1020',38,'coaches','',0),(1022,2,'2020-07-07 23:51:20','2020-07-08 06:51:20','David is a native of Santa Cruz, CA, and spent over thirty years living on Californias beautiful central coast. He grew up playing sports year-round, with a special affinity early on for basketball, cross-country, and track. He took his running career to college and competed for Cal Poly-San Luis Obispo in the intermediate and high hurdles. It was during this phase of his life that he honed in on his volleyball pursuits, switching gears from track &amp; field to mens volleyball at Cal Poly. David has enjoyed coaching the sport for over 15 years and has transferred his love of the game to his three daughters and his son.\r\n\r\nThough very competitive by nature, Davids primary desire is for each player at Club One AZ to grow in their skills as an individual within the team environment. He is inspired by many, but loves this quote by legendary coach John Wooden: <em>Success is peace of mind, which is a direct result of self-satisfaction in knowing you made the effort to become the best of which you are capable.</em> Always looking to learn more about the sport and how to motivate others, David has completed both the beach and indoor coaching accreditation programs sponsored by USA Volleyball (BCAP I &amp; CAP I) and attended numerous coaching clinics.\r\n\r\nDavid and his bride, Larisa, have been married since 1989, and they have four kids who think their dad is pretty awesome - he thinks they are pretty awesome, too :-)','David Ronda','','publish','closed','closed','','david-ronda','','','2020-08-01 14:36:11','2020-08-01 21:36:11','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1022',39,'coaches','',0),(1024,2,'2020-07-08 23:54:15','2020-07-09 06:54:15','Dion was a three year Varsity letter earner at Corona del Sol High School as a DS/Lib for the Aztecs. He earned many other USAV accolades while playing club for Aspire Volleyball Club from his 14U season through 18U.\r\n\r\nDion is currently studying Secondary Education and English as Arizona State University. Though he has many other talents and interests, he loves the sport of volleyball. His desire is to share that passion and knowledge while serving as an inspiration for the players he coaches. He wants to push them to their limit and help them grow as individuals on and off the court. We are glad to have him on our staff!','Dion Deguzman','','publish','closed','closed','','dion-deguzman','','','2020-08-01 14:36:16','2020-08-01 21:36:16','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1024',37,'coaches','',0),(1026,2,'2020-07-10 23:57:01','2020-07-11 06:57:01','Jacob is an Arizona native who started playing volleyball as a freshman in high school. One of the things that inspired him to learn the sport was watching his sister, an All-State volleyball player in high school and later a libero/DS at Arizona State University. Jacob played on the varsity team for Basha High School for three years and earned All-Region honors his junior and senior seasons.\r\n\r\nAfter graduation, he moved to California to play at Golden West College in Huntington Beach as a libero/DS. He and his team won the Junior College Championships that year, but Jacob decided to return to Arizona and continue his studies at Grand Canyon University. He recently completed a Biology degree a GCU, and he plans to attend PA school and eventually work as a dermatologist.\r\n\r\nJacob began coaching in 2012 and has been with Club One AZ since 2013. He also coaches the girls program at Phoenix Country Day High School in Phoenix, AZ.','Jacob Kelty','','publish','closed','closed','','jacob-kelty','','','2020-08-01 14:36:28','2020-08-01 21:36:28','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1026',36,'coaches','',0),(1028,2,'2020-07-12 23:59:52','2020-07-13 06:59:52','Jerry has over 30 years of coaching experience and has been with Club One AZ since 2010. His proficiency at developing skilled players is well known throughout the AZ Region, as he has trained some of the best players to come out of Arizona over the span of his career. Jerry values hard work and determination, always looking for overall improvement  from one practice, one game, one tournament to the next. He is a great asset to Club One AZ, with an eye for quality skill mechanics that is not easily matched. Along with his team coaching duties, Jerry helps in setting the standard of skills excellence across our coaching staff.\r\n\r\nJerry has two daughters and, when not coaching, works for American Airlines as a flight attendant. He has friends all over the country, it seems, because of it!','Jerry Rosenberg','','publish','closed','closed','','jerry-rosenberg','','','2020-08-01 14:36:39','2020-08-01 21:36:39','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1028',35,'coaches','',0),(1033,2,'2020-07-14 00:04:54','2020-07-14 00:04:54','Club One Volleyball | Cassie Richardson','Club One Volleyball | Cassie Richardson','','inherit','open','closed','','cassierichardson-2','','','2020-07-14 00:05:04','2020-07-14 00:05:04','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/CassieRichardson-1.jpg',0,'attachment','image/jpeg',0),(1037,2,'2020-07-14 00:22:25','2020-07-14 00:22:25','Club One Volleyball | Arian Bunthanom','Club One Volleyball | Arian Bunthanom','','inherit','open','closed','','arianbunthanom','','','2020-07-14 00:22:45','2020-07-14 00:22:45','',549,'http://clubonevb.wpengine.com/wp-content/uploads/2020/06/ArianBunthanom.jpg',0,'attachment','image/jpeg',0),(1045,2,'2020-07-14 00:27:24','2020-07-14 00:27:24','Club One Volleyball | Brian Wagner','Club One Volleyball | Brian Wagner','','inherit','open','closed','','brianwagner-2','','','2020-07-14 00:27:49','2020-07-14 00:27:49','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/BrianWagner-1.jpg',0,'attachment','image/jpeg',0),(1047,2,'2020-07-14 00:29:45','2020-07-14 00:29:45','Club One Volleyball | Bri Keller-Galley','Club One Volleyball | Bri Keller-Galley','','inherit','open','closed','','brikellergalley','','','2020-07-14 00:30:02','2020-07-14 00:30:02','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/BriKellerGalley.jpg',0,'attachment','image/jpeg',0),(1049,2,'2020-07-14 00:31:23','2020-07-14 00:31:23','Club One Volleyball | Dave Girts','Club One Volleyball | Dave Girts','','inherit','open','closed','','davegirts-2','','','2020-07-14 00:31:44','2020-07-14 00:31:44','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/DaveGirts-1.jpg',0,'attachment','image/jpeg',0),(1051,2,'2020-07-14 00:34:43','2020-07-14 00:34:43','Club One Volleyball | David R