coaching in 2018 and has absolutely loved every minute of it!\r\n\r\nJessica believes coaches can have such an important impact in a players life. She coaches because she wants to help players learn the game inside and out, as well as grow as individuals and as teammates. She joined the Club One AZ coaching staff in 2018 because the club has such a positive and uplifting environmentalways so welcoming. She sees Club One AZ as one big family that constantly supports and encourages each other.\r\n\r\nOutside of volleyball, Jessica loves to be around friends and family. She enjoys traveling around the world with her husband and going country dancing with friends!','Jessica Dale','','publish','closed','closed','','jessica-dale','','','2020-08-01 14:36:45','2020-08-01 21:36:45','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1060',34,'coaches','',0),(1061,2,'2020-07-14 00:47:17','2020-07-14 00:47:17','Club One Volleyball | Joaquin Santa Cruz','Club One Volleyball | Joaquin Santa Cruz','','inherit','open','closed','','joaquinsantacruz','','','2020-07-14 00:47:34','2020-07-14 00:47:34','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/JoaquinSantaCruz.jpg',0,'attachment','image/jpeg',0),(1062,2,'2020-07-14 00:48:01','2020-07-14 07:48:01','Joaquin was born and raised in Phoenix, Arizona and has coached with Club One AZ since 2011. He graduated from Westview High School in 2009, a three-year letterman for the school\'s varsity baseball team, earning All-Region honors in 2008 and 2009. In 2008, Joaquin was a part of Litchfield Park Juniors Boys 18U volleyball team as a setter, and in 2009, he played for Zia Athletic Club as a defensive specialist and outside hitter.\r\n\r\nJoaquin accepted a scholarship to play Men\'s Volleyball at Ottawa University in Surprise, AZ this past Fall and is preparing now for his first season with the Spirit while studying Business Leadership and Management there.\r\n\r\nDuring his free time, Joaquin enjoys spending time with his friends, family, and his dog, Oakley. He is excited to be part of the Club One AZ family and loves sharing his knowledge of volleyball with Arizona\'s up-and-coming athletes!','Joaquin Santa Cruz','','publish','closed','closed','','joaquin-santa-cruz','','','2020-08-01 14:36:49','2020-08-01 21:36:49','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1062',33,'coaches','',0),(1064,2,'2020-07-14 00:49:58','2020-07-14 00:49:58','Club One Volleyball | Jordan Hill','Club One Volleyball | Jordan Hill','','inherit','open','closed','','jordanhill-2','','','2020-07-14 00:50:18','2020-07-14 00:50:18','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/JordanHill-1.jpg',0,'attachment','image/jpeg',0),(1065,2,'2020-07-14 00:51:49','2020-07-14 00:51:49','Club One Volleyball | Jordan Neal','Club One Volleyball | Jordan Neal','','inherit','open','closed','','jordanneal','','','2020-07-14 00:52:23','2020-07-14 00:52:23','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/JordanNeal.jpg',0,'attachment','image/jpeg',0),(1066,2,'2020-07-16 00:52:54','2020-07-16 07:52:54','Since he started coaching volleyball in 2011, Jordan has led 30 different teams at all levels of competition, both boys and girls. His club teams have earned National Championship bids five times and have been ranked Top 50 nationally four times. Since 2015 he has led the Highland High School girls volleyball program as the Head Varsity Coach, and he also serves as the Assistant Varsity Coach on the boys side.\r\n\r\nJordan has a passion for guiding athletes through the opportunities that volleyball provides to build character and relationships. He loves seeing athletes embrace the challenge of being coached and also challenge themselves to be their best.\r\n\r\nJordan joined the Club One AZ coaching staff in 2019 and is so thankful to have the opportunity to align his passion and skill with an organization that is so evidently committed to character and whole athlete development. He believes Club One AZ has a truly uncommon culture, with unique emphasis on training coaches and athletes to be experts in their field, and also great people :-)\r\n\r\nOutside of volleyball, Jordan loves spending time with his amazing wife and young son. He also enjoys reading, exercising, watching The Office, and golfing.','Jordan Neal','','publish','closed','closed','','jordan-neal','','','2020-08-01 14:37:08','2020-08-01 21:37:08','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1066',32,'coaches','',0),(1070,2,'2020-07-14 00:55:37','2020-07-14 00:55:37','Club One Volleyball | Kayleigh Jarrett','Club One Volleyball | Kayleigh Jarrett','','inherit','open','closed','','kayleighjarrett-2','','','2020-07-14 00:56:10','2020-07-14 00:56:10','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/KayleighJarrett-1.jpg',0,'attachment','image/jpeg',0),(1073,2,'2020-07-14 01:00:48','2020-07-14 01:00:48','Club One Volleyball | Kelsey Girts','Club One Volleyball | Kelsey Girts','','inherit','open','closed','','kelseygirts-2','','','2020-07-14 01:01:07','2020-07-14 01:01:07','',527,'http://clubonevb.wpengine.com/wp-content/uploads/2020/06/KelseyGirts-1.jpg',0,'attachment','image/jpeg',0),(1075,2,'2020-07-14 01:02:20','2020-07-14 01:02:20','Club One Volleyball | Klohe Harrion','Club One Volleyball | Klohe Harrion','','inherit','open','closed','','kloheharrion','','','2020-07-14 01:02:35','2020-07-14 01:02:35','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/KloheHarrion.jpg',0,'attachment','image/jpeg',0),(1076,2,'2020-07-20 01:03:05','2020-07-20 08:03:05','Before coaching at Club One AZ, Klohe had coached volleyball at both the club and YMCA levels. She also competed as a volleyball athlete for three years at Angelo State University, a DII school in San Angelo, Texas (ramem!) She and her team made it to the Sweet 16 of the NCAA tournament every year, and during her last season with the Rams they were Lone Star Conference Tournament Champions!\r\n\r\nKlohe coaches because volleyball has opened so many doors for her and really shaped her to be the person she is today. She would love to impact girls the same way her own coaches have. Klohe joined the Club One AZ coaching staff in 2019 because she has always noticed the togetherness of the club, even back when she was playing club in Arizona, and thought it was awesome! Also, because Club One AZ is so big, she feels there is plenty of opportunity to find your niche.\r\n\r\nWhen shes not coaching, Klohe absolutely loves trying out local restaurants and sites. Even though she was born and raised in Arizona, it wasnt until she got back from college that she realized there is so much she didnt know about her home state! Klohe also works for an awesome company, plays in womens volleyball leagues, and reads quite a bit when she has time.','Klohe Harrion','','publish','closed','closed','','klohe-harrion','','','2020-08-01 14:37:53','2020-08-01 21:37:53','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1076',30,'coaches','',0),(1079,2,'2020-07-14 01:30:47','2020-07-14 01:30:47','Club One Volleyball | Kris Maglunog','Club One Volleyball | Kris Maglunog','','inherit','open','closed','','krismaglunog-2','','','2020-07-14 01:31:08','2020-07-14 01:31:08','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/KrisMaglunog-1.jpg',0,'attachment','image/jpeg',0),(1080,2,'2020-07-21 01:31:19','2020-07-21 08:31:19','','Kris Maglunog','','draft','closed','closed','','','','','2020-08-01 14:37:58','2020-08-01 21:37:58','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1080',31,'coaches','',0),(1082,2,'2020-07-14 01:32:37','2020-07-14 01:32:37','Club One Volleyball | Michael Shannon','Club One Volleyball | Michael Shannon','','inherit','open','closed','','michaelshannon-2','','','2020-07-14 01:32:59','2020-07-14 01:32:59','',0,'http://clubonevb.wpengine.com/wp-content/uploads/2020/07/MichaelShannon-1.jpg',0,'attachment','image/jpeg',0)