ty</li>\r\n 	<li>USAV Beach CAP Certified</li>\r\n 	<li>USAV Beach Impact Certified</li>\r\n 	<li>EVP Pro Tour Qualifier/Player</li>\r\n 	<li>AAA Beach rating in CA</li>\r\n 	<li>AAA Beach rating in AZ</li>\r\n</ul>\r\nRyan is a native of Arizona, growing up in Wickenburg. As the son of an active volleyball player and coach, Ryan has been playing volleyball since birth! He earned a Bachelor\'s in Civil Engineering from Arizona State University in May of 2011. While at ASU, Ryan began to play Beach Volleyball very competitively, earning a AAA Beach rating in Arizona and AA rating in California. He began coaching soon after graduating. Though he has had success indoors, Ryan\'s passion lies in coaching and playing beach volleyball. As a semiprofessional player, he qualified for the EVP Pro Tour and played his first professional tournament in July of 2014.\r\n\r\nRyan became the director of One Beach in 2014 and has been the lead coach of the program since then.\r\n\r\nRyan lives in Gilbert with his wife Kara, their two sons, and three fur babies (two dogs &amp; one cat). He still enjoys playing beach volleyball competitively but spends a majority of his time with his family and coaching. He also has a strong passion for learning and growing and spends any time left over reading, writing, and studying how to better understand people, leadership, and how to better teach and motivate.','Ryan Wrublik','','publish','closed','closed','','ryan-wrublik','','','2020-08-06 12:00:55','2020-08-06 19:00:55','',0,'http://clubonevb.wpengine.com/?post_type=coaches&#038;p=1091',28,'coaches','',0),(1094,2,'2020-07-15 18:53:27','2020-07-15 18:53:27','Club One Volleyball | Kayla Banyai','Club One Volleyball | Kayla Banyai','','inherit','open','closed','','kaylabanyai','','','2020-07-15 18:53:53','2020-07-15 18:53:53','',541,'http://clubonevb.wpengine.com/wp-content/uploads/2020/06/KaylaBanyai.jpg',0,'attachment','image/jpeg',0),(1098,2,'2020-07-20 16:18:00','2020-07-20 23:18:00','Club On