structions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:11:\"placeholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";}','Club One Alumni Button Text','club_one_alumni_button_text','publish','closed','closed','','field_5f1cb2784cf8e','','','2020-07-25 15:31:50','2020-07-25 22:31:50','',330,'https://cluboneaz.com/?post_type=acf-field&p=1156',26,'acf-field','',0),(1157,1,'2020-07-25 15:31:50','2020-07-25 22:31:50','a:10:{s:4:\"type\";s:4:\"text\";s:12:\"instructions\";s:0:\"\";s:8:\"required\";i:0;s:17:\"conditional_logic\";i:0;s:7:\"wrapper\";a:3:{s:5:\"width\";s:0:\"\";s:5:\"class\";s:0:\"\";s:2:\"id\";s:0:\"\";}s:13:\"default_value\";s:0:\"\";s:11:\"placeholder\";s:0:\"\";s:7:\"prepend\";s:0:\"\";s:6:\"append\";s:0:\"\";s:9:\"maxlength\";s:0:\"\";}','Join A Program Button Text','join_a_program_button_text','publish','closed','closed','','field_5f1cb2864cf8f','','','2020-07-25 15:31:50','2020-07-25 22:31:50','',330,'https://cluboneaz.com/?post_type=acf-field&p=1157',30,'acf-field','',0),(1158,2,'2020-07-29 15:07:22','2020-07-29 22:07:22','[vc_row][vc_column][vc_single_image image=\"1376\" img_size=\"full\"][vc_column_text]\r\n<h3><strong>We are now accepting applications for the 2020-21 Beach Volleyball Season!</strong></h3>\r\nPlease carefully review the following details and program descriptions <strong>before</strong> completing the application for placement at the end of this page.[/vc_column_text][vc_single_image image=\"1159\" img_size=\"1500x800\" alignment=\"center\"][vc_column_text]\r\n<h4><strong>One Beach 2020-21 Season Dates:</strong></h4>\r\n<ul>\r\n 	<li>Fall Schedule: August 31st, 2020 - October 31st, 2020 | <a href=\"https://cluboneaz.com/wp-content/uploads/2020/08/Fall-Schedule-One-Beach-2020-21-v2.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Proposed Practice Schedule</a></li>\r\n 	<li>Winter Schedule: November 1st, 2020 - January 31st, 2021 | <a href=\"https://cluboneaz.com/wp-content/uploads/2020/08/Winter-Schedule-One-Beach-2020-21.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Proposed Practice Schedule</a></li>\r\n 	<li>Spring Schedule: February 1st, 2021 - April 30th, 2021 | Practice Schedule TBD</li>\r\n 	<li>Summer Schedule: May 1st, 2021 - July 2nd, 2021 | Practice Schedule TBD</li>\r\n</ul>\r\n<a href=\"https://cluboneaz.com/events/category/beach/\" target=\"_blank\" rel=\"noopener noreferrer\">One Beach Calendar</a>\r\n<h4><strong>Locations:</strong></h4>\r\nTempe (Court One Athletics) &amp; East (Discovery Park-Gilbert)\r\n<h4><strong>Details:</strong></h4>\r\n<ul>\r\n 	<li>No partner required</li>\r\n 	<li>Monthly costs include practices, tournament coaching, and base gear package</li>\r\n 	<li>Commitments are renewed or paused on a monthly basis throughout the One Beach 2020-21 season</li>\r\n</ul>\r\n<h4><strong>Programs Offered:</strong></h4>\r\n(<a href=\"https://cluboneaz.com/play/\" target=\"_blank\" rel=\"noopener noreferrer\">See the \"Club One for Everyone\" section of our Play page</a> to find skillset comparisons of Beginner, Experienced, and Select level athletes that will help determine your current level.)[/vc_column_text][vc_single_image image=\"1160\" img_size=\"1500x800\" alignment=\"center\" title=\"High School Club\"][vc_column_text]\r\n<h4><strong>High School Club</strong></h4>\r\n<ul>\r\n 	<li>Groups: 18T, 16T, 18E</li>\r\n 	<li>Age Division: 15U-18U</li>\r\n 	<li>Athlete Level: Experienced, Select</li>\r\n 	<li>Designed for: Competitive high-school-age female athletes with<strong>significant prior volleyball experience</strong> committed to training to compete on their high school Varsity teams and/or at the collegiate level</li>\r\n 	<li>Cost: $290/month</li>\r\n</ul>\r\n[/vc_column_text][vc_single_image image=\"1161\" img_size=\"1500x800\" alignment=\"center\" title=\"14U Club\"][vc_column_text]\r\n<h4><strong>14U Club</strong></h4>\r\n<ul>\r\n 	<li>Groups: 14T, 14E</li>\r\n 	<li>Age Divisions: 13U-14U</li>\r\n 	<li>Athlete Level: Experienced, Beginner</li>\r\n 	<li>Designed for: Growth-minded, hard-working female athletes with<strong>some prior volleyball experience</strong></li>\r\n 	<li>Cost: $220/month</li>\r\n</ul>\r\n[/vc_column_text][vc_single_image image=\"1162\" img_size=\"1500x800\" alignment=\"center\" title=\"12U Club\"][vc_column_text]\r\n<h4><strong>12U Club</strong></h4>\r\n<ul>\r\n 	<li>Groups: 12T, 12E</li>\r\n 	<li>Age Divisions: 11U-12U</li>\r\n 	<li>Athlete Level: Beginner</li>\r\n 	<li>Designed for: Growth-minded, hard-working female athletes<strong>eager to develop</strong> as athletes and individuals</li>\r\n 	<li>Cost: $220/month</li>\r\n</ul>\r\n[/vc_column_text][vc_single_image image=\"1163\" img_size=\"1500x800\" alignment=\"center\" title=\"Select\"][vc_column_text]\r\n<h4><strong>Select</strong></h4>\r\n<ul>\r\n 	<li>Groups: Select</li>\r\n 	<li>Age Divisions: 15U-18U</li>\r\n 	<li>Athlete Level: Select</li>\r\n 	<li><strong>Selected athletes only.</strong> Our top One Beach volleyball athletes who embody our values and have proven the highest level of commitment to training and competition.</li>\r\n 	<li>Cost: $360/month</li>\r\n</ul>\r\n[/vc_column_text][vc_single_image image=\"1164\" img_size=\"1500x800\" alignment=\"center\" title=\"Hybrid\"][vc_column_text]\r\n<h4><strong>Hybrid</strong></h4>\r\n<ul>\r\n 	<li>Groups: Hybrid</li>\r\n 	<li>Age Divisions: 15U-18U</li>\r\n 	<li>Athlete Level: Select</li>\r\n 	<li>Flexible program designed to work with the busy schedule of Open-level Indoor athletes seeking to pursue both Beach volleyball and Indoor volleyball opportunities at the collegiate level.</li>\r\n 	<li>Cost: $150/month</li>\r\n</ul>\r\n[/vc_column_text][vc_single_image image=\"1165\" img_size=\"1500x800\" alignment=\"center\" title=\"Boys\"][vc_column_text]\r\n<h4><strong>Boys</strong></h4>\r\n<ul>\r\n 	<