en','closed','','14e-practice-one-beach','','','2020-08-21 10:47:04','2020-08-21 17:47:04','',0,'https://cluboneaz.com/?post_type=tribe_events&#038;p=1263',0,'tribe_events','',0),(1281,2,'2020-08-01 13:04:42','2020-08-01 20:04:42','<b>Details:</b>\r\n<ul>\r\n 	<li>No partner required</li>\r\n 	<li>Monthly costs include practices, tournament coaching, and base gear package</li>\r\n 	<li>Commitments are renewed or paused on a monthly basis throughout the One Beach 2020-21 season</li>\r\n</ul>\r\n<b>18E Group:</b>\r\n<ul>\r\n 	<li>Coach: Rich Lanzone</li>\r\n 	<li>Cost: $200/month</li>\r\n</ul>\r\n<a href=\"https://cluboneaz.com/play/beach-volleyball/one-beach-2020-21-season/\">Apply for Placement</a>','18E-Boys Practice | Beach','','publish','open','closed','','18e-boys-practice-one-beach','','','2020-08-21 10:46:24','2020-08-21 17:46:24','',0,'https://cluboneaz.com/?post_type=tribe_events&#038;p=1281',0,'tribe_events','',0),(1299,2,'2020-08-01 12:01:02','2020-08-01 19:01:02','<p>[vc_row][vc_column][vc_single_image image=\"1376\" img_size=\"full\"][vc_column_text]</p>\n<h3><strong>We are now accepting applications for the 2020-21 Beach Volleyball Season!</strong></h3>\n<p>Please carefully review the following details and program descriptions <strong>before</strong> completing the application for placement at the end of this page.[/vc_column_text][vc_single_image image=\"1159\" img_size=\"1500x800\" alignment=\"center\"][vc_column_text]</p>\n<h4><strong>One Beach 2020-21 Season Dates:</strong></h4>\n<ul>\n<li>Fall Schedule: August 31st, 2020 - October 31st, 2020 | <a href=\"https://cluboneaz.com/wp-content/uploads/2020/08/Fall-Schedule-One-Beach-2020-21.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Proposed Practice Schedule</a></li>\n<li>Winter Schedule: November 1st, 2020 - January 31st, 2021 | Proposed Practice Schedule</li>\n<li>Spring Schedule: February 1st, 2021 - April 30th, 2021 | Practice Schedule TBD</li>\n<li>Summer Schedule: May 1st, 2021 - July 2nd, 2021 | Practice Schedule TBD</li>\n</ul>\n<p><a href=\"https://cluboneaz.com/events/category/beach/\" target=\"_blank\" rel=\"noopener noreferrer\">One Beach Calendar</a></p>\n<h4><strong>Locations:</strong></h4>\n<p>Tempe (Court One Athletics) &amp; East (Casteel High School-Queen Creek)</p>\n<h4><strong>Details:</strong></h4>\n<ul>\n<li>No partner required</li>\n<li>Monthly costs include practices, tournament coaching, and base gear package</li>\n<li>Commitments are renewed or paused on a monthly basis throughout the One Beach 2020-21 season</li>\n</ul>\n<h4><strong>Programs Offered:</strong></h4>\n<p>(<a href=\"https://cluboneaz.com/play/\" target=\"_blank\" rel=\"noopener noreferrer\">See the \"Club One for Everyone\" section of our Play page</a> to find skillset comparisons of Beginner, Experienced, and Select level athletes that will help determine your current level.)[/vc_column_text][vc_single_image image=\"1160\" img_size=\"1500x800\" alignment=\"center\" title=\"High School Club\"][vc_column_text]</p>\n<h4><strong>High School Club</strong></h4>\n<ul>\n<li>Groups: 18T, 16T, 18E</li>\n<li>Age Division: 15U-18U</li>\n<li>Athlete Level: Experienced, Select</li>\n<li>Designed for: Competitive high-school-age female athletes with<strong>significant prior volleyball experience</strong> committed to training to compete on their high school Varsity teams and/or at the collegiate level</li>\n<li>Cost: $290/month</li>\n</ul>\n<p>[/vc_column_text][vc_single_image image=\"1161\" img_size=\"1500x800\" alignment=\"center\" title=\"14U Club\"][vc_column_text]</p>\n<h4><strong>14U Club</strong></h4>\n<ul>\n<li>Groups: 14T, 14E</li>\n<li>Age Divisions: 13U-14U</li>\n<li>Athlete Level: Experienced, Beginner</li>\n<li>Designed for: Growth-minded, hard-working female athletes with<strong>some prior volleyball experience</strong></li>\n<li>Cost: $220/month</li>\n</ul>\n<p>[/vc_column_text][vc_single_image image=\"1162\" img_size=\"1500x800\" alignment=\"center\" title=\"12U Club\"][vc_column_text]</p>\n<h4><strong>12U Club</strong></h4>\n<ul>\n<li>Groups: 12T, 12E</li>\n<li>Age Divisions: 11U-12U</li>\n<li>Athlete Level: Beginner</li>\n<li>Designed for: Growth-minded, hard-working female athletes<strong>eager to develop</strong> as athletes and individuals</li>\n<li>Cost: $220/month</li>\n</ul>\n<p>[/vc_column_text][vc_single_image image=\"1163\" img_size=\"1500x800\" alignment=\"center\" title=\"Select\"][vc_column_text]</p>\n<h4><strong>Select</strong></h4>\n<ul>\n<li>Groups: Select</li>\n<li>Age Divisions: 15U-18U</li>\n<li>Athlete Level: Select</li>\n<li><strong>Selected athletes only.</strong> Our top One Beach volleyball athletes who embody our values and have proven the highest level of commitment to training and competition.</li>\n<li>Cost: $360/month</li>\n</ul>\n<p>[/vc_column_text][vc_single_image image=\"1164\" img_size=\"1500x800\" alignment=\"center\" title=\"Hybrid\"][vc_column_text]</p>\n<h4><strong>Hybrid</strong></h4>\n<ul>\n<li>Groups: Hybrid</li>\n<li>Age Divisions: 15U-18U</li>\n<li>Athlete Level: Select</li>\n<li>Flexible program designed to work with the busy schedule of Open-level Indoor athletes seeking to pursue both Beach volleyball and Indoor volleyball opportunities at the collegiate level.</li>\n<li>Cost: $150/month</li>\n</ul>\n<p>[/vc_column_text][vc_single_image image=\"1165\" img_size=\"1500x800\" alignment=\"center\" title=\"Boys\"][vc_column_text]</p>\n<h4><strong>Boys</strong></h4>\n<ul>\n<li>Groups: 18E-Boys</li>\n<li>Age Divisions: 12U-18U</li>\n<li>Athlete Level: Experienced</li>\n<li>Designed for: Growth-minded, hard-working male athletes with <strong>some prior volleyball experience</strong>.</li>\n<li>Cost: $200/month</li>\n</ul>\n<p>See the <a href=\"https://cluboneaz.com/events/category/beach/\" target=\"_blank\" rel=\"noopener noreferrer\">One Beach calendar</a> for practice days, times, locations, and coaches for all programs.</p>\n<p><strong>Complete the following application to be considere