Commitments are renewed or paused on a monthly basis throughout the One Beach 2020-21 season</li>\r\n</ul>\r\n<b>12T Group:</b>\r\n<ul>\r\n 	<li>Coach: Ryan Wrublik</li>\r\n 	<li>Cost: $220/month</li>\r\n</ul>\r\n<a href=\"https://cluboneaz.com/play/beach-volleyball/2020-21-season/\">Apply for Placement</a>','12T Practice | Beach','','publish','open','closed','','12t-practice-one-beach-2020-10-27','','','2020-08-01 13:52:27','2020-08-01 20:52:27','',1227,'https://cluboneaz.com/?post_type=tribe_events&#038;eventDate=2020-10-27#038;p=1227',0,'tribe_events','',0),(1355,2,'2020-08-01 13:06:49','2020-08-01 20:06:49','<b>Details:</b>\r\n<ul>\r\n 	<li>No partner required</li>\r\n 	<li>Monthly costs include practices, tournament coaching, and base gear package</li>\r\n 	<li>Commitments are renewed or paused on a monthly basis throughout the One Beach 2020-21 season</li>\r\n</ul>\r\n<b>12T Group:</b>\r\n<ul>\r\n 	<li>Coach: Ryan Wrublik</li>\r\n 	<li>Cost: $220/month</li>\r\n</ul>\r\n<a href=\"https://cluboneaz.com/play/beach-volleyball/2020-21-season/\">Apply for Placement</a>','12T Practice | Beach','','publish','open','closed','','12t-practice-one-beach-2020-10-29','','','2020-08-01 13:52:27','2020-08-01 20:52:27','',1227,'https://cluboneaz.com/?post_type=tribe_events&#038;eventDate=2020-10-29#038;p=1227',0,'tribe_events','',0),(1376,2,'2020-07-31 16:42:59','2020-07-31 23:42:59','','BeachBanner','','inherit','open','closed','','beachbanner','','','2020-07-31 16:42:59','2020-07-31 23:42:59','',0,'https://cluboneaz.com/wp-content/uploads/2020/07/BeachBanner.png',0,'attachment','image/png',0),(1379,2,'2020-08-01 12:07:38','2020-08-01 19:07:38','','Winter Schedule | One Beach 2020-21','','inherit','open','closed','','winter-schedule-one-beach-2020-21','','','2020-08-01 12:07:38','2020-08-01 19:07:38','',0,'https://cluboneaz.com/wp-content/uploads/2020/08/Winter-Schedule-One-Beach-2020-21.pdf',0,'attachment','application/pdf',0),(1381,2,'2020-08-01 12:30:58','2020-08-01 19:30:58','[vc_row][vc_column][vc_single_image image=\"444\" img_size=\"full\"][vc_column_text]\n<h2>OUR STORY</h2>\n[/vc_column_text][vc_column_text]My wife, Larisa, and I have experienced the value that competitive sport offers, from our own college athletic endeavors as well as those of our daughters. We used this filter to help us in formulating the culture we hoped to embody in the organization we would start<strong>Club One AZ</strong>. It was the summer of 2010 and we were evaluating what next season would look like. After some deliberations we confirmed we wanted to begin a journey of building an organization that respected people as well as promoted competition. We wanted to make sure each individual knew they were valued, but we also understood that the individual is elevated most effectively in the context of team. Now, so many years into our journey, we have begun to see so many of the outcomes we had hoped forcamaraderie, trust, and teamtraits shaped by our motto <strong>We are one</strong>. And by \"we\", I mean a dedicated group of like-minded friendsour coaches at Club One AZ.\n\nWe dont venture to think we have arrived at our goals, but we do believe we are on our way to making a difference: a difference in the way player and parent are valued, a difference in the way coaches are developed, a difference in the way competition is advanced, and a difference in how success is achieved. We realize that our perspective may not align with everyones experiences, but we do believe that our goals bring out the best in people and prepare our athletes handsomely for the future that lie ahead of each of them.\n\nWe hope that you will choose to join us in this journey.\n\n&nbsp;\n\nDirectors, David &amp; Larisa Ronda[/vc_column_text][vc_single_image image=\"1095\" img_size=\"full\"][vc_column_text]\n<h2><strong>Vision</strong>:</h2>\nLeverage the sport of volleyball to develop competitive, service-minded athletes with strong character and a hunger to learn.\n<h2><strong>Mission</strong>:</h2>\nClub One has operated as a not-for-profit 501(c)(3) entity serving the volleyball community in Arizona since 2010. Through our club we strive to build:\n<ul>\n 	<li>Character through the challenges that training and competition provide.</li>\n 	<li>Systems of education that can be duplicated from one generation to the next.</li>\n 	<li>Futures for athletes who desire to compete at higher levels.</li>\n 	<li>Selflessness by nurturing an atmosphere of giving back some of what has been given to you.</li>\n</ul>\nTo achieve these goals, we endeavor to:\n<ul>\n 	<li>Provide the highest quality coaching in a challenging but nurturing environment.</li>\n 	<li>Develop a supportive and participatory relationship with our athletes and parents.</li>\n 	<li>Partner with organizations that can help us reach our ultimate goals of instilling character, competition, community, and learning.</li>\n</ul>\n<h2><strong>Values</strong>:</h2>\n<ul>\n 	<li>Excellence</li>\n 	<li>Integrity</li>\n 	<li>Respect</li>\n 	<li>Commitment</li>\n 	<li>Discipline</li>\n</ul>\n<h2><strong>Staff</strong>:</h2>\n<ul>\n 	<li>Larisa Ronda - Club One Director</li>\n 	<li>David Ronda - Club One Director</li>\n 	<li>Kelsey Girts - Club One Associate Director</li>\n 	<li>Ryan Wrublik - One Beach Director</li>\n 	<li>Lisa Naughton - Administrative Assistant</li>\n 	<li>Cassie Richardson - Communications Manager</li>\n</ul>\n[/vc_column_text][/vc_column][/vc_row]','About Us','','inherit','closed','closed','','751-autosave-v1','','','2020-08-01 12:30:58','2020-08-01 19:30:58','',751,'https://cluboneaz.com/751-autosave-v1/',0,'revision','',0),(1382,2,'2020-08-01 12:43:06','2020-08-01 19:43:06','[vc_row][vc_column][vc_column_text]Club One is excited to be practicing in the Court One Athletic complex again this coming Club season. The space touts over 45,000 square-feet of solid maple flooring with 9 volleyball courts. This is one of the best flooring systems in the country made with a one-inch foam subfloor that allows for softer landingsand fewer injuries.\r\n\r\n<strong><em>Come by and take a tour if you\'ve not seen it.Court One Athletics is locates at:</em></strong>[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_row_inner][vc_column_inner][vc_gmaps link=\"#E-8_\" title=\"Our Facility\"][/vc_column_inner][/vc_row_inner][/vc_column][/vc_row]','Facility','','inherit','closed','closed','','312-autosave-v1','','','2020-08-01 12:43:06','2020-08-01 19:43:06','',312,'https://cluboneaz.com/312-autosave-v1/',0,'revision','',0),(1383,2,'2020-08-01 13:49:57','2020-08-01 20:49:57','Sign up to train with Coach Kelsey Girts!\r\n\r\nThese sessions are open to<strong>Select</strong><strong>high school</strong>athletes with at least <strong>three years</strong> of National level club team experience:\r\n<ul>\r\n 	<li>Middle &amp; Right Side (Specialty Training) | Grades 9th-12th | Tuesday, August 4th | 9:00-10:05am</li>\r\n 	<li>Pass to Attack | Grades 9th-12th | Tuesday, August 4th | 10:10-11:15am</li>\r\n</ul>\r\n<a href=\"https://form.jotform.com/202135921845150\">Sign Up Here</a>','Tuesday Training | 18Platinum Head Coach','','publish','open','closed','','tuesday-training-18platinum-head-coach','','','2020-08-01 13:49:57','2020-08-01 20:49:57','',0,'https://cluboneaz.com/?post_type=tribe_events&#038;p=1383',0,'tribe_events','',0),(1385,2,'2020-08-01 13:48:17','2020-08-01 20:48:17','','Double Block','','inherit','open','closed','','2017-07-02-27683-dsc_6228-final','','','2020-08-01 13:48:29','2020-08-01 20:48:29','',1383,'https://cluboneaz.com/wp-content/uploads/2020/08/2017-07-02-27683-DSC_6228-final.jpg',0,'attachment','image/jpeg',0),(1386,2,'2020-07-01 14:01:01','2020-07-01 21:01:01','<ul>\r\n 	<li>IMPACT</li>\r\n 	<li>USA CAP Level 1</li>\r\n 	<li>USA BCAP Level 2</li>\r\n 	<li>Member of Positive Coaching Alliance</li>\r\n 	<li>Achieved AAA Arizona Rating</li>\r\n 	<li>Achieved AA CBVA Rating</li>\r\n</ul>\r\nAimee started coaching both high school Varsity and club volleyball in San Diego over 20 years ago. She also served as the Director of Starlings Volleyball-San Diego and was the assistant volleyball coach and beach volleyball instructor for Southwestern Community College. After leaving San Diego, Aimee built a sand court facility in Austin, Texas, where she gave lessons and ran leagues &amp; tournaments.\r\n\r\nAs a player, Aimee has competed in several AVP qualifiers and even won several gold medals at the Senior Olympics for indoor volleyball. As a coach, she has seen her athletes win the Harbor League Championship in San Diego, compete at the AAU Beach National Championships, and finish third at the P1440 National Championships.\r\n\r\nAimee coaches because she absolutely loves the game. When she sees an athlete improve and enjoy the game as much as she does, there is nothing better. She wants to create lifelong players of volleyball and grow the game, because she truly believes it is the best sport in the world! Aimee joined One Beach in 2014 because from the first moment she was introduced to the directors, she knew this club was something special. Between the directors passion for the game and their wonderful coaching staff, she knew she had found a coaching home. Aimee sees that One Beach cares about the athletes first and foremost, and they treat everyone as family.\r\n\r\nOutside of volleyball, Aimee plays competitive tennis and is on two traveling teams. She also enjoys mountain biking, CrossFit, and learning to play the ukulele. You can often catch her traveling around to cheer at all her daughters beach volleyball matches with Cal Poly, SLO :-)','Aimee Richardson','','publish','closed','closed','','aimee-richardson','','','2020-08-11 16:45:05','2020-08-11 23:45:05','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1386',29,'coaches','',0),(1389,2,'2020-07-26 14:04:55','2020-07-26 21:04:55','Rich is originally from New York, where he learned the sport of beach volleyball on the sands of the south shore of Long Island. Since moving to AZ in 2007, he has been an avid promoter of the growth of beach volleyball in Arizona. Rich has competed in countless area leagues and tournaments while also organizing adult and junior beach volleyball events, and hes been a member of the AVCA since 2007. He is also known for photographing the local tournaments and is media credentialed for both the AVP and FIVB beach volleyball tours. In addition, Rich has over 20 years experience coaching indoor high school volleyball at both the Varsity and JV levels, where his teams have enjoyed multiple state playoff appearances and earned many AVCA Team Academic Awards.\r\n\r\nRich coaches in order to help grow the sport and provide the next generation of players with the wonderful opportunities and benefits that volleyball has offered him for over 30 years. He joined One Beach in 2020 for three main reasons: 1) One Beach shares his commitment for growing the sport, 2) the club holds high expectations for both the athletes and coaches, and 3) the leadership consistently reinforces a supportive and positive culture.<span class=\"Apple-converted-space\"></span>\r\n\r\nOutside of volleyball, Rich enjoys spending quality time with his son, Lucas, as well as photography, gardening, and writing.','Rich Lanzone','','publish','closed','closed','','rich-lanzone','','','2020-08-11 12:24:32','2020-08-11 19:24:32','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1389',26,'coaches','',0),(1390,2,'2020-08-01 14:04:20','2020-08-01 21:04:20','Rich Lanzone | One Beach Volleyball','Rich Lanzone | One Beach Volleyball','','inherit','open','closed','','richlanzone','','','2020-08-01 14:04:52','2020-08-01 21:04:52','',1389,'https://cluboneaz.com/wp-content/uploads/2020/08/RichLanzone.jpg',0,'attachment','image/jpeg',0),(1391,2,'2020-07-24 14:08:06','2020-07-24 21:08:06','Before becoming a coach, Mike competed on the volleyball squad at Grossmont College in El Cajon, California. He now coaches both in the gym and on the sand, training boys and girls indoor volleyball athletes since 2015 and beach volleyball athletes since 2013. Mike has also served as the head beach volleyball coach at Basha High School since 2018. He holds a GMS Beach certification.\r\n\r\nMike coaches because coaching the next generation is a great opportunity to give back to the sport he loves and to teach young athletes skills to be successful on and off the court. He joined One Beach in 2018 because the program curates an amazing culture and prioritizes complete development for the athletes.\r\n\r\nWhen hes not playing or coaching, Mike loves to cook!','Mike Carrington','','publish','closed','closed','','mike-carrington','','','2020-08-18 12:05:16','2020-08-18 19:05:16','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1391',25,'coaches','',0),(1392,2,'2020-08-01 14:07:45','2020-08-01 21:07:45','Mike Carrington | One Beach Volleyball','Mike Carrington | One Beach Volleyball','','inherit','open','closed','','mikecarrington','','','2020-08-01 14:08:02','2020-08-01 21:08:02','',1391,'https://cluboneaz.com/wp-content/uploads/2020/08/MikeCarrington.jpg',0,'attachment','image/jpeg',0),(1393,2,'2020-07-17 14:14:39','2020-07-17 21:14:39','Justin started coaching volleyball in 2009 and has dedicated himself to learning and growing in the art of coaching ever since. He has experience coaching both middle school and high school club teams, as well as both indoor and beach high school teams in Division 6A, and also many training groups and duos in the One Beach program!<span class=\"Apple-converted-space\"></span>\r\n\r\nJustins love for sports started with baseball when he was four years old. He played many years of Little League baseball and was recruited to a club baseball team that won a National Championship and two State Championships. While in junior high, Justin discovered volleyball, and it has been his passion ever since. He was a three-year varsity player at Sandra Day O\'Connor High School, playing defensive specialist for two years before changing positions to be the starting setter his senior year, for which he received All-Region and All-State recognitions. After high school, Justin focused his attention on the beach game and earned his AAA sand rating in Arizona.\r\n\r\nJustin coaches because he wants to provide a role model, a listening ear, a friend, or a mentor to an athlete, because he never had one growing up. He loves the game of volleyball and the lessons that can be learned alongside a teammate while chasing a common goal. Justin has been an integral part of the Club One AZ coaching staff since 2012. In his words, Straight and simple, we are a family trying to provide athletes and their families a home away from home, where they can laugh, learn, and sweat.\r\n\r\nOutside of volleyball, Justin loves fishing, camping, playing beach volleyball, and playing card and board games with friends.','Justin Marshall','','publish','closed','closed','','justin-marshall','','','2020-08-01 14:37:15','2020-08-01 21:37:15','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1393',27,'coaches','',0),(1394,2,'2020-08-01 14:12:25','2020-08-01 21:12:25','Justin Marshall | One Beach Volleyball','Justin Marshall | One Beach Volleyball','','inherit','open','closed','','justinmarshall','','','2020-08-01 14:12:40','2020-08-01 21:12:40','',1393,'https://cluboneaz.com/wp-content/uploads/2020/08/JustinMarshall.jpg',0,'attachment','image/jpeg',0),(1395,2,'2020-07-01 14:20:17','2020-07-01 21:20:17','','Jenn Moore','','publish','closed','closed','','jenn-moore','','','2020-08-06 12:00:22','2020-08-06 19:00:22','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1395',24,'coaches','',0),(1396,2,'2020-08-01 14:18:23','2020-08-01 21:18:23','Jenn Moore | One Beach Volleyball','Jenn Moore | One Beach Volleyball','','inherit','open','closed','','jennmoore','','','2020-08-01 14:18:43','2020-08-01 21:18:43','',1395,'https://cluboneaz.com/wp-content/uploads/2020/08/JennMoore.jpg',0,'attachment','image/jpeg',0),(1397,2,'2020-07-29 14:24:42','2020-07-29 21:24:42','','Vanessa Bernzen','','publish','closed','closed','','vanessa-bernzen','','','2020-08-01 14:39:07','2020-08-01 21:39:07','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1397',23,'coaches','',0),(1398,2,'2020-08-01 14:24:23','2020-08-01 21:24:23','Vanessa Bernzen | One Beach Volleyball','Vanessa Bernzen | One Beach Volleyball','','inherit','open','closed','','vanessabernzen','','','2020-08-01 14:24:39','2020-08-01 21:24:39','',1397,'https://cluboneaz.com/wp-content/uploads/2020/08/VanessaBernzen.jpg',0,'attachment','image/jpeg',0),(1399,2,'2020-07-25 14:27:26','2020-07-25 21:27:26','Priscilla has a wealth of experience competing at elite levels, and she brings her insight from those experiences into her coaching. She played with the University of Georgia indoor volleyball program from 1991-1995, where earned multiple All-American and All-Conference honors over the course of her career, include SEC Freshman of the Year and SEC Player of the Year. During that time, she also competed with the USA National Team and played at the National Team World University Games in 1995. Priscilla holds an NCAA record for kills per matcha whopping 53and was inducted into the University of Georgia Circle of Honor in 2006. After her college career, she went on to play one year of professional indoor volleyball in Switzerland.\r\n\r\nAs a coach, Priscilla holds both BCAP and GMS Beach certifications. She has served as the head beach volleyball coach at Millennium High School since 2017 and has led the program to two back-to-back state runner-up finishes. She also served as an assistant beach volleyball coach at Arizona State University from 2018-19.\r\n\r\nPriscilla coaches because she loves the sport, because young women can learn and grow in sport and life by seeing other women in positions of influence, because she has the chance to help young athletes achieve their goals, and because her gifts and her experience have given her an opportunity to teach values and volleyball skills at the same time. She joined One Beach in 2017 because she loves being part of a team/staff that has similar core values to her own and a true concern for developing the whole athlete.\r\n\r\nOutside of volleyball, Priscilla enjoys writing, mindset/performance coaching, reading, fitness, and folding origami cranes :-)','Priscilla Tallman','','publish','closed','closed','','priscilla-tallman','','','2020-08-18 11:53:40','2020-08-18 18:53:40','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1399',22,'coaches','',0),(1400,2,'2020-08-01 14:27:00','2020-08-01 21:27:00','Priscilla Tallman | One Beach Volleyball','Priscilla Tallman | One Beach Volleyball','','inherit','open','closed','','priscillatallman','','','2020-08-01 14:27:21','2020-08-01 21:27:21','',1399,'https://cluboneaz.com/wp-content/uploads/2020/08/PriscillaTallman.jpg',0,'attachment','image/jpeg',0),(1401,2,'2020-08-01 14:29:21','2020-08-01 21:29:21','Ryan Wrublik | One Beach Volleyball','Ryan Wrublik | One Beach Volleyball','','inherit','open','closed','','ryanwrublik-2','','','2020-08-01 14:29:35','2020-08-01 21:29:35','',1091,'https://cluboneaz.com/wp-content/uploads/2020/07/RyanWrublik-1.jpg',0,'attachment','image/jpeg',0),(1402,2,'2020-07-09 14:31:20','2020-07-09 21:31:20','','Jackie Bunker','','publish','closed','closed','','jackie-bunker','','','2020-08-01 14:36:21','2020-08-01 21:36:21','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1402',21,'coaches','',0),(1403,2,'2020-08-01 14:31:04','2020-08-01 21:31:04','Jackie Bunker | One Beach Volleyball','Jackie Bunker | One Beach Volleyball','','inherit','open','closed','','jackiebunker','','','2020-08-01 14:31:18','2020-08-01 21:31:18','',1402,'https://cluboneaz.com/wp-content/uploads/2020/08/JackieBunker.jpg',0,'attachment','image/jpeg',0),(1404,2,'2020-08-03 09:40:11','2020-08-03 16:40:11','Aimee Richardson | One Beach Volleyball','Aim