-at-5-01-26-pm','','','2020-08-05 17:16:17','2020-08-06 00:16:17','',1413,'https://cluboneaz.com/wp-content/uploads/2020/08/Screen-Shot-2020-08-05-at-5.01.26-PM.png',0,'attachment','image/png',0),(1416,2,'2017-08-06 11:51:04','2017-08-06 18:51:04','','Vanessa Bernzen','','publish','closed','closed','','vanessa-bernzen','','','2020-08-26 16:22:30','2020-08-26 23:22:30','',0,'https://cluboneaz.com/?post_type=players&#038;p=1416',0,'players','',0),(1418,2,'2020-08-06 11:50:50','2020-08-06 18:50:50','','VanessaBernzen','','inherit','open','closed','','vanessabernzen-2','','','2020-08-06 11:50:50','2020-08-06 18:50:50','',1416,'https://cluboneaz.com/wp-content/uploads/2020/08/VanessaBernzen-1.jpg',0,'attachment','image/jpeg',0),(1419,2,'2020-07-23 11:57:00','2020-07-23 18:57:00','Matea competes with the Arizona State University Beach Volleyball program after enjoying a decorated high school career in both beach and indoor volleyball. She racked up multiple district, region, and academic awards while competing at Perry High School, and spent time volunteer coaching both for her high school and club programs. She now serves as an assistant coach for the Varsity volleyball team at Highland High School.\r\n\r\nMatea coaches because she seeks opportunities to implement servant leadership and make a positive impact. She hopes to help others continually grow as both athletes and people in their communities. Matea joined the One Beach/Club One coaching staff in 2020 because both programs are built on a steadfast foundation of quality values, making the benefit of the athlete the driving force of operation. She appreciates how the programs consciously integrate ideals that shape well-rounded athletes.\r\n\r\nOutside of volleyball, Matea enjoys spending time with friends and family, as well as any outdoor activities!','Matea Suan','','publish','closed','closed','','matea-suan','','','2020-08-13 13:29:18','2020-08-13 20:29:18','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1419',20,'coaches','',0),(1420,2,'2020-08-06 11:57:42','2020-08-06 18:57:42','Matea Suan | One Beach Volleyball','Matea Suan | One Beach Volleyball','','inherit','open','closed','','mateasuan','','','2020-08-06 11:58:04','2020-08-06 18:58:04','',1419,'https://cluboneaz.com/wp-content/uploads/2020/08/MateaSuan.jpg',0,'attachment','image/jpeg',0),(1421,2,'2020-07-01 14:01:38','2020-07-01 21:01:38','Alexis played college volleyball at Concordia University-Chicago her freshman year before returning to Arizona, where she now attends Grand Canyon University and competes on the club volleyball team. Alexis has also coached volleyball for the City of Gilbert and conducted private lessons for kids wanting to improve their skills.<span class=\"Apple-converted-space\"></span>\r\n\r\nAlexis coaches because she loves helping girls learn the sport and share the love and life lessons that come from sports teams. She joined Club One AZ as a player in 2013 and continued to play for the club until her last season in 2018. She has so many great memories of the Club One AZ family. The support of David, Larisa, and all the coaches throughout her time as a player taught her so much, and she wants to be the same influence on girls lives as they were for her.\r\n\r\nOutside of volleyball, Alexis enjoys spending time with friends and family, traveling, and going on adventures.','Alexis Hill','','publish','closed','closed','','alexis-hill','','','2020-08-06 14:09:05','2020-08-06 21:09:05','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1421',19,'coaches','',0),(1425,2,'2020-08-06 14:08:22','2020-08-06 21:08:22','Alexis Hill | Club One Volleyball','Alexis Hill | Club One Volleyball','','inherit','open','closed','','alexishill-1','','','2020-08-06 14:08:37','2020-08-06 21:08:37','',1421,'https://cluboneaz.com/wp-content/uploads/2020/08/AlexisHill-1.jpg',0,'attachment','image/jpeg',0),(1426,2,'2020-07-02 12:10:28','2020-07-02 19:10:28','Alyssa started coaching volleyball in Missouri in 2008, where she worked with multiple high school and middle school club teams. She has coached in Arizona at both the middle school and high school levels since 2015, and she served as the Varsity head coach for Desert Mountain High School in 2018, taking the program to the state playoffs for the first time in eight years.\r\n\r\nAlyssa also competed in college volleyball at Lindenwood University in Missouri, where she was a four year Varsity starting libero. During her freshman year, she and her team made their first national tournament appearance and ultimately took 5th place. Over the course of her career, Alyssa and her team won four conference titles and enjoyed three national appearances. She received multiple conference and region awards as a libero and also set the school digs record!\r\n\r\nAlyssa coaches because the support, lessons, and experiences she received from her coaches while playing volleyball are things she will never forget. She wants to be able to share and provide those same opportunities to other young women. Alyssa joined the Club One AZ coaching staff in 2019 because the club has always been competitive and shares the same values and beliefs that she does. She is excited to be a part of the #COVfamily!<span class=\"Apple-converted-space\"></span>\r\n\r\nWhen shes not in the gym, Alyssa enjoys spending time with her family and friends, playing sand volleyball, and traveling. Outside of coaching, she works as a mental health therapist for at-risk teens.<span class=\"Apple-converted-space\"></span>','Alyssa Showers','','publish','closed','closed','','alyssa-showers','','','2020-08-06 14:11:32','2020-08-06 21:11:32','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1426',18,'coaches','',0),(1428,2,'2020-07-05 14:12:02','2020-07-05 21:12:02','Volleyball has been a part of Carens life for over 15 years, spanning her transition from playing to coaching. She played club for several years and finished off her high school career at Club One AZ during its inaugural season. Caren then began coaching in 2013 and has had the opportunity over the years to coach club and high school volleyball at several different ages and levels. She also played one season for Missouri Valley College as a DS/L before transferring to ASU to complete her degree.\r\n\r\nCaren coaches to grow the game and love of volleyball, as well as to instill teamwork and tenacity. She joined the Club One AZ coaching staff in 2016 because she values an encouraging, safe atmosphere that promotes quality volleyball and the importance of process over product, which is exactly what Club One AZ provides.\r\n\r\nOutside of volleyball, Caren enjoys spending time with her family and kitties, as well as baking and movie nights.','Caren Coe','','publish','closed','closed','','caren-coe','','','2020-08-06 14:13:25','2020-08-06 21:13:25','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1428',17,'coaches','',0),(1429,2,'2020-07-05 17:13:34','2020-07-06 00:13:34','Charity has been playing volleyball since she was eight years old and recently started coaching as an assistant at the high school varsity levelat Tempe Prep on the girls side and Seton Catholic on the boys side.\r\n\r\nVolleyball was so pivotal for Charity growing up, and she wants to help the latter half of her generation find the best in themselves through this sport. She joined the Club One AZ coaching staff in 2019 because she loves what the club is doing for volleyball in Arizona, and she wants to be a part of it.<span class=\"Apple-converted-space\"></span>\r\n\r\nOutside of volleyball, Charity enjoys working in student ministries at my church, cooking, and spending time with my friends and family.','Charity Reischmann','','publish','closed','closed','','charity-reischmann','','','2020-08-06 14:16:37','2020-08-06 21:16:37','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1429',16,'coaches','',0),(1430,2,'2020-08-06 14:16:05','2020-08-06 21:16:05','Charity Reischmann | Club One Volleyball','Charity Reischmann | Club One Volleyball','','inherit','open','closed','','charityreischmann','','','2020-08-06 14:16:30','2020-08-06 21:16:30','',1429,'https://cluboneaz.com/wp-content/uploads/2020/08/CharityReischmann.jpg',0,'attachment','image/jpeg',0),(1431,2,'2020-07-05 18:17:12','2020-07-06 01:17:12','Christine started playing volleyball when she was 12 years old and was fortunate to be trained by many Club One AZ coaches before the club even existed! Larisa Ronda was her first volleyball coach in sixth grade, around the same time Brian Wagner and his wife offered to pay her in private lessons for babysitting their kids :-) Jerry Rosenberg was her club coach for both her 14s and 15s years. Things came full circle when she assisted Brian at Club One AZ in 2017 and then Jerry in 2018!<span class=\"Apple-converted-space\"></span>\r\n\r\nChristine was voted Captain and MVP her senior season at Mountain Pointe High School and went on to earn a college volleyball scholarship. She would also like to be remembered for her intramural coed dodgeball championship victory!\r\n\r\nChristine coaches because she knows coaches can make a huge impact on their players, whether good and bad. It\'s important to her that she can positively influence young athletes while challenging them to compete at a higher level. She joined the Club One AZ coaching staff in 2017 and values the clubs stated mission to build character through the challenges that training and competition provide. Character is really important to her!\r\n\r\nOutside of volleyball, Christine enjoys coffee, pickle-ball, baking, and serving as a personal shopper for her lucky friends and family :-)','Christine Winkelman','','publish','closed','closed','','christine-winkelman','','','2020-08-06 14:20:44','2020-08-06 21:20:44','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1431',15,'coaches','',0),(1433,2,'2020-08-06 14:20:12','2020-08-06 21:20:12','Christine Winkleman | Club One Volleyball','Christine Winkleman | Club One Volleyball','','inherit','open','closed','','christinewinkelman','','','2020-08-06 14:20:32','2020-08-06 21:20:32','',1431,'https://cluboneaz.com/wp-content/uploads/2020/08/ChristineWinkelman.jpg',0,'attachment','image/jpeg',0),(1434,2,'2020-08-06 14:27:05','2020-08-06 21:27:05','Larisa Ronda | Club One Volleyball','Larisa Ronda | Club One Volleyball','','inherit','open','closed','','larisaronda','','','2020-08-06 14:27:19','2020-08-06 21:27:19','',543,'https://cluboneaz.com/wp-content/uploads/2020/07/LarisaRonda.jpg',0,'attachment','image/jpeg',0),(1435,2,'2020-08-06 14:31:03','2020-08-06 21:31:03','David & Larisa Ronda | Club One Directors','David & Larisa Ronda | Club One Directors','','inherit','open','closed','','davidlarisa','','','2020-08-06 14:31:21','2020-08-06 21:31:21','',751,'https://cluboneaz.com/wp-content/uploads/2020/08/DavidLarisa.jpg',0,'attachment','image/jpeg',0),(1436,2,'2020-08-06 14:48:06','2020-08-06 21:48:06','','Clara Bednarek','','publish','closed','closed','','clara-bednarek-2','','','2020-08-06 14:48:06','2020-08-06 21:48:06','',0,'https://cluboneaz.com/?post_type=players&#038;p=1436',0,'players','',0),(1437,2,'2020-08-06 14:47:59','2020-08-06 21:47:59','','ClaraBednarek','','inherit','open','closed','','clarabednarek','','','2020-08-06 14:47:59','2020-08-06 21:47:59','',1436,'https://cluboneaz.com/wp-content/uploads/2020/08/ClaraBednarek.jpg',0,'attachment','image/jpeg',0),(1438,2,'2020-08-06 15:00:05','2020-08-06 22:00:05','','Jessi Medlin','','publish','closed','closed','','jessi-medlin-2','','','2020-08-06 15:00:05','2020-08-06 22:00:05','',0,'https://cluboneaz.com/?post_type=players&#038;p=1438',0,'players','',0),(1439,2,'2020-08-06 14:59:57','2020-08-06 21:59:57','','JessiMedlin','','inherit','open','closed','','jessimedlin','','','2020-08-06 14:59:57','2020-08-06 21:59:57','',1438,'https://cluboneaz.com/wp-content/uploads/2020/08/JessiMedlin.jpg',0,'attachment','image/jpeg',0),(1440,2,'2020-08-06 15:14:20','2020-0