-head results</li>\r\n 	<li>Three-way tie determined by point differential</li>\r\n</ul>\r\n<strong>COST</strong>\r\n$20/athlete ($80/team)\r\n\r\n<a href=\"https://mcusercontent.com/6a3a26cf5b6afb5b0efc3ff00/files/6db66aab-9d72-4408-bdf7-e6829b6674ae/4x4_Tournament_August_15_2020.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Download Printable Flyer</a>\r\n\r\n<strong>SAFETY MEASURES</strong>\r\n<ul>\r\n 	<li><strong>No spectators</strong> are allowed in the gym. (You are welcome to send along an iPhone or iPad to tape or live stream!)</li>\r\n 	<li>Athletes must <strong>wear masks</strong> while entering and exiting the facility.</li>\r\n 	<li>Athletes must bring their own <strong>waterbottles</strong>.</li>\r\n 	<li>Sign-ups are limited to <strong>five teams per division.</strong></li>\r\n 	<li>Each division will have all their matches on the same <strong>two courts.</strong></li>\r\n 	<li>Two <strong>separate waves</strong> to limit the number of people in the gym at a time.</li>\r\n</ul>\r\nYou must read, sign, and adhere to all safety measures listed in the Court One and Club One AZ waivers in order to participate (linked in the sign-up form). Thank you!\r\n\r\n<a href=\"https://form.jotform.com/202206153014134\" target=\"_blank\" rel=\"noopener noreferrer\">Sign Up Here</a>','4x4 Tournament | 12U-14U | Indoor','','publish','open','closed','','4x4-tournament-12u-14u-indoor','','','2020-08-08 13:04:52','2020-08-08 20:04:52','',0,'https://cluboneaz.com/?post_type=tribe_events&#038;p=1455',0,'tribe_events','',0),(1456,2,'2020-08-08 13:07:40','2020-08-08 20:07:40','<strong>WAVE #2: 15U-18U\r\nDivisions:</strong>\r\n<ol>\r\n 	<li>15-18U Club/Championship Girls</li>\r\n 	<li>15-18U Open Girls</li>\r\n 	<li>15-18U Coed (maximum of two guys per team, or team can be all girls)</li>\r\n</ol>\r\nCheck-in &amp; warm-up from 10:30-10:50am.\r\nPlay begins at 11:00am.\r\nPlay ends at 1:00pm.\r\n\r\n<strong>FORMAT</strong>\r\nPlay every team in your division.\r\nFive te