els since 2012, both club and middle school, and has led the Aprende Middle School volleyball program since 2017. In 2018, the Aprende team had an undefeated season and ultimately won the championship (against a rival school, no less), and they won it again in 2020! Her club teams have consistently moved up in rankings each year, especially on championship day.<span class=\"Apple-converted-space\"></span>\r\n\r\nChristy has a deep passion for the game, the fundamentals, and teamwork. She coaches because she cannot play the game that she has loved all her life anymore, so she wants to give her love of volleyball to a new generation. She teaches the TEAM of volleyball, the SKILLS of volleyball, and the FUN of volleyball! Christy joined the Club One AZ coaching staff in 2018 because the motto <i>We are One </i>resonates with hershe coaches her teams like they are ONE family, which includes both the kids and the parents.\r\n\r\nWhen shes not in the gym, Christy enjoys anything outside, especially hiking! She also loves yoga, reading, spinning, and watching sports.','Christy Wilson','','publish','closed','closed','','christy-wilson','','','2020-08-13 14:34:41','2020-08-13 21:34:41','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1502',14,'coaches','',0),(1504,2,'2020-08-13 14:33:09','2020-08-13 21:33:09','Christy Wilson | Club One Volleyball','Christy Wilson | Club One Volleyball','','inherit','open','closed','','christywilson','','','2020-08-13 14:33:25','2020-08-13 21:33:25','',1502,'https://cluboneaz.com/wp-content/uploads/2020/08/ChristyWilson.jpg',0,'attachment','image/jpeg',0),(1505,2,'2020-07-26 14:45:39','2020-07-26 21:45:39','Raiyen has been coaching volleyball since 2016, working with a variety of age groups and levels on both the girls and boys sides. She joined the Club One AZ coaching staff in 2018.\r\n\r\nRaiyen coaches because she loves to help the kids reach their full potential in the game. She finds it extremely gratifying to watch them become the players she knows they can be, and to be a part of that transformation is amazing. She sticks with Club One AZ because it is a club that truly cares about its players, and the staff are passionate about the game, which is something she can relate to.\r\n\r\nWhen shes not coaching, Raiyen is busy being a full-time student at ASU, where she studies Environmental Science. She hopes to work with sea lions and seals in a rescue/rehabilitation center. Her passions outside of volleyball include anything having to do with the ocean and animals!','Raiyen Fielding','','publish','closed','closed','','raiyen-fielding','','','2020-08-13 14:47:07','2020-08-13 21:47:07','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1505',13,'coaches','',0),(1506,2,'2020-08-13 14:45:16','2020-08-13 21:45:16','Raiyen Fielding | Club One Volleyball','Raiyen Fielding | Club One Volleyball','','inherit','open','closed','','raiyenfielding','','','2020-08-13 14:45:31','2020-08-13 21:45:31','',1505,'https://cluboneaz.com/wp-content/uploads/2020/08/RaiyenFielding.jpg',0,'attachment','image/jpeg',0),(1507,2,'2020-08-13 15:05:26','2020-08-13 22:05:26','Jackie has been coaching with One Beach since 2014. She is the Varsity head coach for both the indoor and beach volleyball programs at Arcadia High School. Jackie served as the Director of Operations and assistant beach volleyball coach for the Arizona State University volleyball program from 2013-2016. She has been coaching volleyball for over 15 years and counting.\n\n&lt;p&gt;During her short time at Arcadia High School, Jackie has helped the Titans earn back to back state play-off appearances in Indoor as well as their first ever play-off appearance in Beach Team and Pairs competition.&lt;/p&gt;\n\n&lt;p&gt;In 2008, Jackie graduated Summa Cum Laude from ASU with a BAE in secondary education. In 2015, she earned her Master\'s Degree at ASU in Higher and Post-Secondary Education with Summa Cum Laude honors as well. Jackie and her husband Mark have a beautiful daughter together.&lt;/p&gt;','Jackie Bunker','','inherit','closed','closed','','1402-autosave-v1','','','2020-08-13 15:05:26','2020-08-13 22:05:26','',1402,'https://cluboneaz.com/1402-autosave-v1/',0,'revision','',0),(1508,2,'2018-08-13 15:21:50','2018-08-13 22:21:50','','Rylie Arms','','publish','closed','closed','','rylie-arms','','','2020-08-13 15:22:55','2020-08-13 22:22:55','',0,'https://cluboneaz.com/?post_type=players&#038;p=1508',0,'players','',0),(1510,2,'2020-08-13 15:22:22','2020-08-13 22:22:22','','Rylie_Arms-1','','inherit','open','closed','','rylie_arms-1','','','2020-08-13 15:22:22','2020-08-13 22:22:22','',1508,'https://cluboneaz.com/wp-content/uploads/2020/08/Rylie_Arms-1.jpg',0,'attachment','image/jpeg',0),(1511,2,'2018-08-13 15:27:36','2018-08-13 22:27:36','','Kayla Subbert','','publish','closed','closed','','kayla-subbert','','','2020-08-13 15:32:03','2020-08-13 22:32:03','',0,'https://cluboneaz.com/?post_type=players&#038;p=1511',0,'players','',0),(1512,2,'2020-08-13 15:28:12','2020-08-13 22:28:12','','KaylaSubbert-1','','inherit','open','closed','','kaylasubbert-1','','','2020-08-13 15:28:12','2020-08-13 22:28:12','',1511,'https://cluboneaz.com/wp-content/uploads/2020/08/KaylaSubbert-1.jpg',0,'attachment','image/jpeg',0),(1514,2,'2018-08-13 15:32:07','2018-08-13 22:32:07','','Brianna Lopez','','publish','closed','closed','','brianna-lopez','','','2020-08-13 15:32:54','2020-08-13 22:32:54','',0,'https://cluboneaz.com/?post_type=players&#038;p=1514',0,'players','',0),(1515,2,'2020-08-13 15:32:43','2020-08-13 22:32:43','','Brianna-Lopez-1','','inherit','open','closed','','brianna-lopez-1','','','2020-08-13 15:32:43','2020-08-13 22:32:43','',1514,'https://cluboneaz.com/wp-content/uploads/2020/08/Brianna-Lopez-1.jpg',0,'attachment','image/jpeg',0),(1516,2,'2018-08-13 15:35:43','2018-08-13 22:35:43','','Claudia Wilson','','publish','closed','closed','','claudia-wilson','','','2020-08-13 15:36:32','2020-08-13 22:36:32','',0,'https://clubon