 16:21:37','2020-08-13 23:21:37','',1544,'https://cluboneaz.com/wp-content/uploads/2020/08/MaraMeehan-1.jpg',0,'attachment','image/jpeg',0),(1546,2,'2020-08-14 17:40:41','2020-08-15 00:40:41','We\'re excited to offer this Train &amp; Play series for competitivehigh school athletes as they prepare for the upcoming school season!\n\n<strong>WHO:</strong>\n<ul>\n 	<li><em>Experienced</em>and<em>Select</em>level athletes<strong>|</strong>Girls 9<sup>th</sup>-12<sup>th</sup>grade (15U-18U)</li>\n 	<li>Go to<a href=\"https://cluboneaz.com/play/\">https://cluboneaz.com/play/</a>for description of skill levels</li>\n</ul>\n<strong>WHAT:</strong>\n\n<u>Tuesdays &amp; Thursdays</u>: Twice-a-week clinic-style training to help hone in on skill development, techniques, mechanics, court awareness, and competitive game IQ necessary for high school volleyball.\n\n<u>Saturdays</u>: Once-a-week facilitated game play to put the training into real-time practice!\n\n<strong>WHEN:</strong>\n\nTuesdays| August 18 &amp; 25 | 5:15pm-6:45pm (1.5 hrs)\nThursdays| August 20 &amp; 27 | 7:00pm-8:30pm (1.5 hrs)\nSaturdays | August 22 &amp; 29 | 11:30-1:00pm (1.5 hrs)\n\n<strong>Registration Options:</strong>\n<ol>\n 	<li><strong>Full Two-Week Series Package:</strong>$135(All six dates)</li>\n 	<li><strong>Tuesdays Only:</strong>$55(Two dates)</li>\n 	<li><strong>Thursdays Only:</strong>$55(Two dates)</li>\n 	<li><strong>Saturdays Only:</strong>$35 (Two dates)</li>\n 	<li><strong>Single Day Purchase:</strong>(will open on Saturday, August 15th, if space allows)\n<ul>\n 	<li>Tuesday or Thursday - $30</li>\n 	<li>Saturday - $20</li>\n</ul>\n</li>\n</ol>\n<strong>Safety Measures</strong>\n<ul>\n 	<li>Sessions are limited to <strong>10 athletes per court.</strong></li>\n 	<li><strong>No spectators</strong> are allowed in the gym. (You are welcome to send along an iPhone or iPad to tape or live stream!)</li>\n 	<li>Athletes must <strong>wear masks</strong> while entering and exiting the facility.</li>\n 	<li>Athletes must bring their own <strong>waterbottles</strong>.</li>\n</ul>\nYou must read, sign, and adhere to all safety measures listed in the Court One and Club One AZ waivers in order to participate (linked in the sign-up form). Thank you!\n\n<a href=\"https://mcusercontent.com/6a3a26cf5b6afb5b0efc3ff00/files/46da5f62-80d7-4434-a39f-12896af74d53/HS_Train_Play_Aug2020.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Download Printable Flyer</a>\n\n<a href=\"https://form.jotform.com/202225285360145\" target=\"_blank\" rel=\"noopener noreferrer\">Sign Up for Packages</a>(available until Monday, August 17)\n\n<a href=\"https://form.jotform.com/202255011166139\" target=\"_blank\" rel=\"noopener noreferrer\">Sign Up for Single Days</a>','High School Train & Play | Indoor','','inherit','closed','closed','','1460-autosave-v1','','','2020-08-14 17:40:41','2020-08-15 00:40:41','',1460,'https://cluboneaz.com/1460-autosave-v1/',0,'revision','',0),(1547,2,'2020-08-14 17:41:48','2020-08-15 00:41:48','We\'re excited to offer this Train &amp; Play series for competitivehigh school athletes as they prepare for the upcoming school season!\r\n\r\n<strong>WHO:</strong>\r\n<ul>\r\n 	<li><em>Experienced</em>and<em>Select</em>level athletes<strong>|</strong>Girls 9<sup>th</sup>-12<sup>th</sup>grade (15U-18U)</li>\r\n 	<li>Go to<a href=\"https://cluboneaz.com/play/\">https://cluboneaz.com/play/</a>for description of skill levels</li>\r\n</ul>\r\n<strong>WHAT:</strong>\r\n\r\n<u>Tuesdays &amp; Thursdays</u>: Twice-a-week clinic-style training to help hone in on skill development, techniques, mechanics, court awareness, and competitive game IQ necessary for high school volleyball.\r\n\r\n<u>Saturdays</u>: Once-a-week facilitated game play to put the training into real-time practice!\r\n\r\n<strong>WHEN:</strong>\r\n\r\nTuesdays| August 18 &amp; 25 | 5:15pm-6:45pm (1.5 hrs)\r\nThursdays| August 20 &amp; 27 | 7:00pm-8:30pm (1.5 hrs)\r\nSaturdays | August 22 &amp; 29 | 11:30-1:00pm (1.5 hrs)\r\n\r\n<strong>Registration Options:</strong>\r\n<ol>\r\n 	<li><strong>Full Two-Week Series Package:</strong>$135(All six dates)</li>\r\n 	<li><strong>Tuesdays Only:</strong>$55(Two dates)</li>\r\n 	<li><strong>Thursdays Only:</strong>$55(Two dates)</li>\r\n 	<li><strong>Saturdays Only:</strong>$35 (Two dates)</li>\r\n 	<li><strong>Single Day Purchase:</strong>(will open on Saturday, August 15, if space allows)\r\n<ul>\r\n 	<li>Tuesday or Thursday - $30</li>\r\n 	<li>Saturday - $20</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<strong>Safety Measures</strong>\r\n<ul>\r\n 	<li>Sessions are limited to <strong>10 athletes per court.</strong></li>\r\n 	<li><strong>No spectators</strong> are allowed in the gym. (You are welcome to send along an iPhone or iPad to tape or live stream!)</li>\r\n 	<li>Athletes must <strong>wear masks</strong> while entering and exiting the facility.</li>\r\n 	<li>Athletes must bring their own <strong>waterbottles</strong>.</li>\r\n</ul>\r\nYou must read, sign, and adhere to all safety measures listed in the Court One and Club One AZ waivers in order to participate (linked in the sign-up form). Thank you!\r\n\r\n<a href=\"https://mcusercontent.com/6a3a26cf5b6afb5b0efc3ff00/files/46da5f62-80d7-4434-a39f-12896af74d53/HS_Train_Play_Aug2020.pdf\" target=\"_blank\" rel=\"noopener noreferrer\">Download Printable Flyer</a>\r\n\r\n<a href=\"https://form.jotform.com/202225285360145\" target=\"_blank\" rel=\"noopener noreferrer\">Sign Up for Packages</a>(available until Monday, August 17)\r\n\r\n<a href=\"https://form.jotform.com/202255011166139\" target=\"_blank\" rel=\"noopener noreferrer\">Sign Up for Single Days</a>','High School Train & Play | Indoor','','inherit','closed','closed','','1466-autosave-v1','','','2020-08-14 17:41:48','2020-08-15 00:41:48','',1466,'https://cluboneaz.com/1466-autosave-v1/',0,'revision','',0),(1552,3,'2020-08-19 12:30:06','2020-08-19 19:30:06','','Club_One_Social_Img','','inherit','open','closed','','club_one_social_img','','','2020-08-19 12:30:06','2020-08-19 19:30:06','',0,'https://cluboneaz.com/wp-content/uploads/2020/08/Club_One_Social_Img.jpg',0,'attachment','image/jpeg',0),(1554,2,'2020-08-20 13:38:55','2020-08-20 20:38:55','Emil started coaching volleyball in 2009 and a year later received the opportunity to launch a club in the Chandler/Gilbert area. He began coaching high school ball in 2014 and now serves as the Varsity assistant head coach for the Campo Verde girls program and as the JV head coach for the Perry boys program, where his team enjoyed an undefeated season in 2019!<span class=\"Apple-converted-space\"></span>\r\n\r\nHe also coaches on both the boys and girls sides at the club level as well, and his teams have enjoyed multiple top-20 finishes. One of the highlights of Emils own playing career was finishing second at the mens club Haili VB tournament in Maui, where his team was also awarded Most Outstanding Team!<span class=\"Apple-converted-space\"></span>\r\n\r\nEmil coaches so he can share what he has learned over the years, and to see the players grow on and off the court. He joined the Club One AZ coaching staff in 2018 because he had an opportunity to be a part of a great organization and jumped on it!\r\n\r\nOutside of volleyball, Emils honey-do list is his hobby :-) and Ohana (Family) is his #1.','Emil (Nui) Rubin','','publish','closed','closed','','emil-nui-rubin','','','2020-08-20 13:38:55','2020-08-20 20:38:55','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1554',12,'coaches','',0),(1556,2,'2020-08-20 13:38:15','2020-08-20 20:38:15','Nui Rubin | Club One Volleyball','Nui Rubin | Club One Volleyball','','inherit','open','closed','','nuirubin','','','2020-08-20 13:38:52','2020-08-20 20:38:52','',1554,'https://cluboneaz.com/wp-content/uploads/2020/08/NuiRubin.jpg',0,'attachment','image/jpeg',0),(1557,2,'2020-08-20 13:44:23','2020-08-20 20:44:23','Mahea started coaching volleyball in 2013, while also enjoying a playing career on both the NAU Indoor Club Team, where she played Libero, and the NAU Beach Club team, where she and her partner were ranked the #1 girls doubles team in the program. In her playing career, she has won several intramural and tournament championships, and she was named Female Scholar-Athlete of the Year, among other awards and recognitions.\r\n\r\nMahea coaches because she only wishes to share her passion for the game that has shaped her into the person she is today. She hopes to inspire all of her players to be better people, both on and off the court, and to make an overall positive impact on their lives. When she joined Club One AZ in 2018, it didnt take long for her to notice that everyone here truly is a family, working together as one. She appreciates how David &amp; Larisa take good care of their staff, as well as their players, and she has never felt so welcome into a program as a new coach.\r\n\r\nMahea loves spending time with her family, going to the beach, binge-watching TV shows, and hanging out with her dogs :-)','Mahea Rubin','','publish','closed','closed','','mahea-rubin','','','2020-08-20 13:44:23','2020-08-20 20:44:23','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1557',11,'coaches','',0),(1558,2,'2020-08-20 13:43:51','2020-08-20 20:43:51','Mahea Rubin | Club One Volleyball','Mahea Rubin | Club One Volleyball','','inherit','open','closed','','mahealanirubin-1','','','2020-08-20 13:44:18','2020-08-20 20:44:18','',1557,'https://cluboneaz.com/wp-content/uploads/2020/08/MahealaniRubin-1.jpg',0,'attachment','image/jpeg',0),(1559,2,'2020-08-20 13:58:40','2020-08-20 20:58:40','Mandy played at Mesa Community College as a setter/DS and started coaching right out of college. She returned to coaching again several years ago, both at the Y and with club. Committed to continuing her education as a coach, she has completed the Gold Medal Squared coaching clinic and is also CAP I certified with USA Volleyball.<span class=\"Apple-converted-space\"></span>\r\n\r\nMandy coaches because she loves the game of volleyball and want to help young players develop their skill while also maintaining their love of the game. She joined the Club One AZ coaching staff in 2018 because the clubs mission and values align very closely with her own personal values. She believes that sports can help us teach our children important and valuable life skills that will help them grow into good and productive people in our society and community.\r\n\r\nOutside of volleyball, Mandy enjoys reading and spending time with her three kids, even the two that don\'t play volleyball. ;-)','Mandy Rohde','','publish','closed','closed','','mandy-rohde','','','2020-08-20 13:58:40','2020-08-20 20:58:40','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1559',10,'coaches','',0),(1560,2,'2020-08-20 13:58:09','2020-08-20 20:58:09','Mandy Rohde | Club One Volleyball','Mandy Rohde | Club One Volleyball','','inherit','open','closed','','mandyrohde-1','','','2020-08-20 13:58:28','2020-08-20 20:58:28','',1559,'https://cluboneaz.com/wp-content/uploads/2020/08/MandyRohde-1.jpg',0,'attachment','image/jpeg',0),(1561,2,'2020-08-20 16:35:43','2020-08-20 23:35:43','Paige played club volleyball at Club One AZ starting in 2013. Throughout those years she spent a lot of time in the gym and always admired the coaches, so she started volunteering to coach the minute she was able to, both with the OneU clinics and on the One Beach side. From early on, Paige knew coaching was something she wanted to continue doing. Since then, she has assisted on club teams as well as head coached for many different teams through the Gilbert YMCA/Club One partnership program.\r\n\r\nPaige has also continued her own playing career at Benedictine University in Mesa, where she competes on both the indoor and beach volleyball squads.<span class=\"Apple-converted-space\"></span>\r\n\r\nPaige coaches because she wants to help develop young athletes and give them a great experience, helping them to fall in love with volleyball the way she did. Club One/One Beach has always been a home for her; her volleyball family has watched her grow and supported her through thick and thin. She will always be grateful to Club One and One Beach for the great friends and experiences they have given her as a player and as a coachshe couldnt picture herself anywhere else.\r\n\r\nOutside of volleyball, Paiges hobbies include drawing and painting. For the past couple years she has been painting Hydroflasks for fun, so dont be surprised if you see them around the gym or on Instagram! @paiges_paintedhydros :-)','Paige Padilla','','publish','closed','closed','','paige-padilla','','','2020-08-20 16:35:43','2020-08-20 23:35:43','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1561',9,'coaches','',0),(1562,2,'2020-08-20 16:35:21','2020-08-20 23:35:21','Paige Padilla | Club One Volleyball','Paige Padilla | Club One Volleyball','','inherit','open','closed','','paigepadilla-1','','','2020-08-20 16:35:39','2020-08-20 23:35:39','',1561,'https://cluboneaz.com/wp-content/uploads/2020/08/PaigePadilla-1.jpg',0,'attachment','image/jpeg',0),(1563,2,'2020-08-21 10:40:31','2020-08-21 17:40:31','','Discovery Park','','publish','closed','closed','','discovery-park','','','2020-08-21 10:40:31','2020-08-21 17:40:31','',0,'https://cluboneaz.com/venue/discovery-park/',0,'tribe_venue','',0),(1564,2,'2020-08-01 13:06:09','2020-08-01 20:06:09','<b>Details:</b>\r\n<ul>\r\n 	<li>No partner required</li>\r\n 	<li>Monthly costs include beach volleyball practices, tournament coaching, and One Beach gear</li>\r\n 	<li>Commitments are renewed or paused on a monthly basis throughout the One Beach 2020-21 season</li>\r\n</ul>\r\n<b>14E Group:</b>\r\n<ul>\r\n 	<li>Coach: Mike Carrington</li>\r\n 	<li>Cost: $220/month</li>\r\n</ul>\r\n<a href=\"https://cluboneaz.com/play/beach-volleyball/2020-21-season/\">Apply for Placement</a>','14E Practice | Beach','','publish','open','closed','','14e-practice-one-beach-2020-09-07','','','2020-