,'inherit','open','closed','','img_3235_heic-1','','','2020-08-22 15:16:40','2020-08-22 22:16:40','',1616,'https://cluboneaz.com/wp-content/uploads/2020/08/IMG_3235_heic-1.jpg',0,'attachment','image/jpeg',0),(1619,2,'2020-08-22 15:23:50','2020-08-22 22:23:50','<strong>WAVE #1: 12U-14U</strong>\r\n\r\n<strong>Divisions:</strong>\r\n<ol>\r\n 	<li>11-12U Club</li>\r\n 	<li>12-14U Club</li>\r\n 	<li>12-14U Championship</li>\r\n 	<li>13-14U Championship/Open (*boys allowed, 8th grade or younger)</li>\r\n</ol>\r\nCheck-in &amp; warm-up from 3:00am-3:20pm.\r\nPlay begins at 3:30pm.\r\nPlay ends at 5:30pm.\r\n\r\n*<strong>Please note:</strong>All age levels are according tothe upcoming<strong>2020-21 season:</strong>\r\n<ul>\r\n 	<li>Current 5th graders = 11U</li>\r\n 	<li>Current 6th graders = 12U</li>\r\n 	<li>Current 7th graders = 13U</li>\r\n 	<li>Current 8th graders = 14U</li>\r\n</ul>\r\n<strong>FORMAT</strong>\r\nPlay every team in your division.\r\nFive teams per division, two-court tournament format.\r\nTimed ~20 minute rounds.\r\nEach team refs one round.\r\n\r\n<strong>Winning Team Wins Prizes!</strong>\r\nDetermined by total matches won, or:\r\n<ul>\r\n 	<li>Two-way tie determined by head-to-head results</li>\r\n 	<li>Three-way tie determined by point differential</li>\r\n</ul>\r\n<strong>COST</strong>\r\n$22/athlete ($88/team)\r\n\r\n<strong>SAFETY MEASURES</strong>\r\n<ul>\r\n 	<li><strong>No spectators</strong> are allowed in the gym. (You are welcome to send along an iPhone or iPad to tape or live stream!)</li>\r\n 	<li>Athletes must <strong>wear masks</strong> while entering and exiting the facility.</li>\r\n 	<li>Athletes must bring their own <strong>waterbottles</strong>.</li>\r\n 	<li>Sign-ups are limited to <strong>five teams per division.</strong></li>\r\n 	<li>Each division will have all their matches on the same <strong>two courts.</strong></li>\r\n 	<li>Two <strong>separate waves</strong> to limit the number of people in the gym at a time.</li>\r\n</ul>\r\nYou must read, sign, and adhere to all safety measures listed in the Court One and Club One AZ waivers in order to participate (linked in the sign-up form). Thank you!\r\n\r\n<a href=\"https://form.jotform.com/202338102399150\" target=\"_blank\" rel=\"noopener noreferrer\">Sign Up Here</a>','4x4 Tournament | 12U-14U | Indoor','','publish','open','closed','','4x4-tournament-12u-14u-indoor-2','','','2020-08-22 15:23:50','2020-08-22 22:23:50','',0,'https://cluboneaz.com/?post_type=tribe_events&#038;p=1619',0,'tribe_events','',0),(1620,2,'2020-08-22 15:23:12','2020-08-22 22:23:12','','4x4 | 12U-14U','','inherit','open','closed','','img_3227_heic-1','','','2020-08-22 15:23:22','2020-08-22 22:23:22','',1619,'https://cluboneaz.com/wp-content/uploads/2020/08/IMG_3227_heic-1.jpg',0,'attachment','image/jpeg',0),(1627,2,'2020-08-24 16:11:59','2020-08-24 23:11:59','','Fall Schedule | One Beach 2020-21 | v2','','inherit','open','closed','','fall-schedule-one-beach-2020-21-v2','','','2020-08-24 16:11:59','2020-08-24 23:11:59','',0,'https://cluboneaz.com/wp-content/uploads/2020/08/Fall-Schedule-One-Beach-2020-21-v2.pdf',0,'attachment','application/pdf',0),(1628,2,'2020-08-27 13:54:57','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2020-08-27 13:54:57','0000-00-00 00:00:00','',0,'https://cluboneaz.com/?p=1628',0,'post','',0),(1629,2,'2020-08-27 14:39:00','2020-08-27 21:39:00','<div class=\"tribe-events-single-event-description tribe-events-content\">\r\n\r\n<strong>What to expect from Small Group Training (SGT):</strong>\r\n<ul>\r\n 	<li>Designed for <strong>Experienced</strong> and <strong>Select</strong> level club athletes.(Go to<a href=\"https://cluboneaz.us7.list-manage.com/track/click?u=6a3a26cf5b6afb5b0efc3ff00&amp;id=d9cb6826f1&amp;e=b53a540272\" data-cke-saved-href=\"https://cluboneaz.us7.list-manage.com/track/click?u=6a3a26cf5b6afb5b0efc3ff00&amp;id=d9cb6826f1&amp;e=b53a540272\">https://cluboneaz.com/play/</a>for description of skill levels.)\r\n<ul>\r\n 	<li>Grades 9th-12th must have a minimum of<strong>3 years</strong>of club experience.</li>\r\n</ul>\r\n</li>\r\n 	<li>Specific positional skills training with highly qualified club coaches</li>\r\n 	<li>Low coach-player ratio</li>\r\n</ul>\r\nSee the schedule of sessions for this date below.\r\n\r\n<img class=\"alignnone wp-image-1630 \" src=\"https://cluboneaz.com/wp-content/uploads/2020/08/Screen-Shot-2020-08-27-at-1.07.07-PM.png\" alt=\"\" width=\"466\" height=\"211\" />\r\n\r\n*Please note that the following sessions are for <strong>Select</strong> level athletes only:\r\n<ul>\r\n 	<li>1:00-2:05pm | Setting</li>\r\n 	<li>2:10-3:15pm | MB/RS Specialty</li>\r\n</ul>\r\n<a href=\"https://form.jotform.com/202396230055145\" target=\"_blank\" rel=\"noopener noreferrer\">Sign Up for 9th-12th Grade Sessions</a>\r\n\r\n</div>','Small Group Training | Indoor','','publish','open','closed','','small-group-training-indoor-5','','','2020-08-27 14:48:54','2020-08-27 21:48:54','',0,'https://cluboneaz.com/?post_type=tribe_events&#038;p=1629',0,'tribe_events','',0),(1630,2,'2020-08-27 14:36:26','2020-08-27 21:36:26','','Small Group Training | August 29','','inherit','open','closed','','screen-shot-2020-08-27-at-1-07-07-pm','','','2020-08-27 14:36:39','2020-08-27 21:36:39','',1629,'https://cluboneaz.com/wp-content/uploads/2020/08/Screen-Shot-2020-08-27-at-1.07.07-PM.png',0,'attachment','image/png',0),(1631,2,'2020-08-27 14:43:16','2020-08-27 21:43:16','<div class=\"tribe-events-single-event-description tribe-events-content\">\n\n<strong>What to expect from Small Group Training (SGT):</strong>\n<ul>\n 	<li>Designed for <strong>Experienced</strong> and <strong>Select</strong> level club athletes.(Go to<a href=\"https://cluboneaz.us7.list-manage.com/track/click?u=6a3a26cf5b6afb5b0efc3ff00&amp;id=d9cb6826f1&amp;e=b53a540272\" data-cke-saved-href=\"https://cluboneaz.us7.list-manage.com/track/click?u=6a3a26cf5b6afb5b0efc3ff00&amp;id=d9cb6826f1&amp;e=b53a540272\">https://cluboneaz.com/play/</a>for description of skill levels.)\n<ul>\n 	<li>Grades 9th-12th must have a minimum of<strong>3 years</strong>of club experience.</li>\n</ul>\n</li>\n 	<li>Specific positional skills training with highly qualified club coaches</li>\n 	<li>Low coach-player ratio</li>\n</ul>\nSee the schedule of sessions for this date below.\n\n<img class=\"alignnone wp-image-1630 \" src=\"https://cluboneaz.com/wp-content/uploads/2020/08/Screen-Shot-2020-08-27-at-1.07.07-PM.png\" alt=\"\" width=\"466\" height=\"211\" />\n\n*Please note that the following sessions are for <strong>Select</strong> level athletes only:\n<ul>\n 	<li>1:00-2:05pm | Setting</li>\n 	<li>2:10-3:15pm | MB/RS Specialty</li>\n</ul>\n&nbsp;\n\n<a href=\"https://form.jotform.com/202396230055145\" target=\"_blank\" rel=\"noopener noreferrer\">Sign Up for 9th-12th Grade Sessions</a>\n\n</div>','Small Group Training | Indoor','','inherit','closed','closed','','1629-autosave-v1','','','2020-08-27 14:43:16','2020-08-27 21:43:16','',1629,'https://cluboneaz.com/1629-autosave-v1/',0,'revision','',0),(1632,2,'2020-08-28 16:46:51','2020-08-28 23:46:51','Eric is the Director of Outreach for the Arizona Region of USA Volleyball. He wears many hats in that role: Coaching Education Director, PR-Marketing Director, etc. Eric was instrumental in starting the Arizona Region\'s High Performance Program from inception until 2012. His job as Outreach Director takes him to places where there is no volleyball, including inner city schools and Native American Reservations. Eric also works with PE teachers, clubs and parents to help educate and develop programs to grow the sport.\r\n\r\nIn some of his free time during the summer, Eric works with Gold Medal Squared conducting camps and clinics for all age levels. His passion for leading camps and clinics has taken him to several countries including Canada, Sweden, Germany, and the Netherlands. Eric recently served as the US Embassy Sports Envoy to the Philippine Islands.\r\n\r\nTo say the least, Eric is one busy guy, serving the volleyball community because of his passion for the sport. We are proud to have him on our staff!','Eric Hodgson','','publish','closed','closed','','eric-hodgson','','','2020-08-28 16:46:51','2020-08-28 23:46:51','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1632',8,'coaches','',0),(1633,2,'2020-08-28 16:40:50','0000-00-00 00:00:00','','Auto Draft','','auto-draft','closed','closed','','','','','2020-08-28 16:40:50','0000-00-00 00:00:00','',0,'https://cluboneaz.com/?post_type=coaches&p=1633',0,'coaches','',0),(1634,2,'2020-08-28 16:44:14','2020-08-28 23:44:14','Eric Hodgson | Club One Volleyball','Eric Hodgson | Club One Volleyball','','inherit','open','closed','','eric','','','2020-08-28 16:44:34','2020-08-28 23:44:34','',1632,'https://cluboneaz.com/wp-content/uploads/2020/08/Eric.jpg',0,'attachment','image/jpeg',0),(1635,2,'2020-08-28 16:50:17','2020-08-28 23:50:17','Jenni has been part of Club One AZ since the beginning in 2010, coaching and lending a hand in a variety of ways. Born and raised in Elmhurst, IL, Jenni was always active in sports and fell in love with volleyball in the sixth grade. She competed in high school and continues to play indoor and on the sand when she gets a chance. Jenni coached YMCA ball for several years and in 2006, with the assistance of others, started the Tempe YMCA TYgers AZ Region team, serving as club director and head coach for three years. Besides coaching, she works as an executive administrative assistant at the Western Refining, and enjoys volunteering and spending time with family and friends.\r\n\r\nJenni enjoys seeing players learn the sport and witnessing their excitement when they learn a new skill or reach one of their goals. Her goal is to be a positive coach, helping to develop the mental and physical skills of her players. She continues to be a cheerleader to her daughter Bri (also a Club One AZ coach) on and off the court!','Jenni Keller','','publish','closed','closed','','jenni-keller','','','2020-08-28 16:50:17','2020-08-28 23:50:17','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1635',7,'coaches','',0),(1636,2,'2020-08-28 16:49:56','2020-08-28 23:49:56','Jenni Keller | Club One Volleyball','Jenni Keller | Club One Volleyball','','inherit','open','closed','','jennikeller','','','2020-08-28 16:50:12','2020-08-28 23:50:12','',1635,'https://cluboneaz.com/wp-content/uploads/2020/08/JenniKeller.jpg',0,'attachment','image/jpeg',0),(1637,2,'2020-08-28 16:53:15','2020-08-28 23:53:15','Kat is an Arizona native and 2017 graduate of Queen Creek High School. She played varsity volleyball all four years there and was second team All-Region libero her senior season. Kat was a Club One AZ athlete for five years and loved every minute of it!\r\n\r\nKat is currently setting for the volleyball program at Benedictine University in Mesa, AZ while studying pre-med. She is excited to be able to give back to the program she has spent so much of her time with. It is her goal to impart knowledge and skill development to her players in order for them to become the best competitors possible. Kat strives to encourage teamwork and hopes to be an inspiration to young women who share her love of volleyball.','Kat McCullough','','publish','closed','closed','','kat-mccullough','','','2020-08-28 16:53:15','2020-08-28 23:53:15','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1637',6,'coaches','',0),(1638,2,'2020-08-28 16:52:54','2020-08-28 23:52:54','Kat McCullough | Club One Voleyball','Kat McCullough | Club One Voleyball','','inherit','open','closed','','katmccullough-2','','','2020-08-28 16:53:10','2020-08-28 23:53:10','',1637,'https://cluboneaz.com/wp-content/uploads/2020/08/KatMcCullough.jpg',0,'attachment','image/jpeg',0),(1639,2,'2020-08-28 16:54:06','2020-08-28 23:54:06','Shannon started coaching volleyball in 2015 at a charter school in Goodyear. In her first season with the middle school team, they went undefeated and ultimately won the championship! They have enjoyed multiple top three finishes since then.<span class=\"Apple-converted-space\"></span>\r\n\r\nCoaching has allowed Shannon to fall in love with the game of volleyball in a way she never knew as a player. She has found coaching to be the most rewarding position she has ever held. Shannon joined the Club One AZ coaching staff in 2019 because the club values the person behind each player. She believes as coaches we hold a large responsibility to instill not only volleyball skills but quality characteristics within each athlete.\r\n\r\nOutside of the gym, Shannon works as a second grade teacher. She is an avid coffee consumer and spends her free time with friends and family!','Shannon Castle','','publish','closed','closed','','shannon-castle','','','2020-08-28 16:54:06','2020-08-28 23:54:06','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1639',5,'coaches','',0),(1640,2,'2020-08-28 16:53:47','2020-08-28 23:53:47','Shannon Castle | Club One Volleyball','Shannon Castle | Club One Volleyball','','inherit','open','closed','','shannoncastle','','','2020-08-28 16:54:01','2020-08-28 23:54:01','',1639,'https://cluboneaz.com/wp-content/uploads/2020/08/ShannonCastle.jpg',0,'attachment','image/jpeg',0),(1641,2,'2020-08-28 16:55:21','2020-08-28 23:55:21','Shannon joined the Club One AZ coaching staff in 2011. What he enjoys most about coaching is seeing the smile on an athlete\'s face when they achieve something they never thought was possible. In his own words, I firmly believe an athlete should be challenged and pushed beyond their current abilities with the understanding that failure is a necessary tool for learning and growth.\r\n\r\nBeyond developing sound skills and a strategic understanding of the sport, Shannon focuseson building a team culture grounded in strong principles and philosophies. At the<span class=\"Apple-converted-space\"></span>base of that culture is an understanding that trust is something we EARN through our actions and devotion to others.\r\n\r\nWe are thrilled with the passion and attention to detail the Shannon brings to his<span class=\"Apple-converted-space\"></span>teams. He is a treasured member of the #COVfamily!','Shannon McMillian','','publish','closed','closed','','shannon-mcmillian','','','2020-08-28 16:55:21','2020-08-28 23:55:21','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1641',4,'coaches','',0),(1642,2,'2020-08-28 16:54:47','2020-08-28 23:54:47','Shannon McMillian | Club One Volleyball','Shannon McMillian | Club One Volleyball','','inherit','open','closed','','shannonmcmillian','','','2020-08-28 16:55:03','2020-08-28 23:55:03','',1641,'https://cluboneaz.com/wp-content/uploads/2020/08/ShannonMcMillian.jpg',0,'attachment','image/jpeg',0),(1643,2,'2020-08-28 16:56:18','2020-08-28 23:56:18','Tait has coached both boys and girls high school volleyball since 2013, first at Mountain View High School and now at Highland High School, where his teams recently enjoyed back-to-back undefeated seasons. He has coached boys club teams since 2010, with two region championship wins so far, and started coaching club on the girls side in 2018. During his own high school playing career, Tait was awarded Region MVP and named to the All-State &amp; All-Region First Teams his senior year.\r\n\r\nTait coaches because he loves volleyball and wants the athletes he coaches to love volleyball as well. He also coaches to make the athletes he works with better people and players. He joined the Club One AZ coaching staff in 2019 because of the unity that everyone has in the organization and the dedication that is shown by everyone to always improve and progress.\r\n\r\nOutside of volleyball, you can find Tait hanging out with his wife and four-year-old daughter. He also loves playing guitar, basketball, camping, watching Arizona sports, and working out.','Tait Neilson','','publish','closed','closed','','tait-neilson','','','2020-08-28 16:56:18','2020-08-28 23:56:18','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1643',3,'coaches','',0),(1644,2,'2020-08-28 16:55:59','2020-08-28 23:55:59','Tait Neilson | Club One Volleyball','Tait Neilson | Club One Volleyball','','inherit','open','closed','','taitneilson','','','2020-08-28 16:56:15','2020-08-28 23:56:15','',1643,'https://cluboneaz.com/wp-content/uploads/2020/08/TaitNeilson.jpg',0,'attachment','image/jpeg',0),(1645,2,'2020-08-28 16:58:38','2020-08-28 23:58:38','An Arizona native, Geoff grew up in Chandler and played four years of high school volleyball at Corona del Sol. He also played club volleyball for Platinum, Team AZ and Primitive. While at Corona, he earned a Varsity letter for volleyball and another for swim &amp; dive\r\n\r\nAfter graduating, Geoff attended University of Arizona and was a manager for their Division I womens volleyball team all four years. At Arizona, he was able to work with some of the best players in the nation, alongside coaches Dave Rubio, Steve Walker, Dana Burkholder and Chris Gonzalez. Geoff also played on the Arizona mens club team for one season. During his junior and senior years, he was an assistant coach for the UA womens club volleyball team. During his senior year, Geoff was an assistant coach at Rincon High School in Tucson for the boys volleyball team when they took second in state.\r\n\r\nGeoff graduated from the University of Arizona with a B.S.E. in Physical Education. After coaching the boys and girls JV teams at Marcos de Niza High School for four years, he joined the coaching staff at Corona in 2014, where he is currently the head coach for the CdS Boys program while heading the Girls JV team as well. There is no such thing as too much volleyball for Geoff!\r\n\r\nDuring his time away from the court, Geoff enjoys going mountain biking.','Geoff Horewitch','','publish','closed','closed','','geoff-horewitch','','','2020-08-28 16:58:38','2020-08-28 23:58:38','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1645',2,'coaches','',0),(1646,2,'2020-08-28 17:01:00','2020-08-29 00:01:00','Natalie has been coaching volleyball since 2004, both at the club and high school levels. For the last 5 years she has coached boys and girls varsity volleyball at small schools in the Valley. The highlight of her coaching career so far was taking a small school team to the CAA state semi-finals in 2017.\r\n\r\nNatalie is passionate about coaching dynamic and technically solid volleyball. She loves the sport, and she loves teaching. Passing on her passion and joy for the game to new generations of players is the most rewarding thing she has ever done. She joined the Club One AZ coaching staff in 2019 because the club shares her values, namely integrity and competitive skill-building.\r\n\r\nNatalie is a professional photographer outside of the gym, so she loves to go on road trips and organize fun editorial photo shoots. She also reads a ton, hikes, paddle-boards, rides horses, paints, and ballroom dances.','Natalie Rockwell','','publish','closed','closed','','natalie-rockwell','','','2020-08-28 17:01:00','2020-08-29 00:01:00','',0,'https://cluboneaz.com/?post_type=coaches&#038;p=1646',0,'coaches','',0),(1647,2,'2020-08-28 17:00:37','2020-08-29 00:00:37','Natalie Rockwell | Club One Volleyball','Natalie Rockwell | Club One Volleyball','','inherit','open','closed','','natalierockwell','','','2020-08-28 17:00:55','2020-08-29 00:00:55','',1646,'https://cluboneaz.com/wp-content/uploads/2020/08/NatalieRockwell.jpg',0,'attachment','image/jpeg',0);
